INSERT INTO `sanpham` VALUES (1,'Lê Nâu Hàn Quốc (Thùng quà 5Kg)','thùng',650000,'Hàn Quốc',5000,'thùng 5Kg','Quả Lê Hàn Quốc hình dạng tròn đẹp mắt với màu vỏ hơi nâu vàng, thịt quả trắng, giòn, ngọt, nhiều nước. Lê Hàn Quốc là loại quả được người Hàn Quốc ưa chuộng và chọn lựa cho những hộp quà đẳng cấp. Size quả lớn, đẹp và ngon chất lượng, loại lê này đã có mặt trên khắp thế giới.$Những người nông dân sẽ thu hoạch Lê Hàn Quốc vào 3 thời điểm khác nhau: trước khi lê chín khoảng 2 tuần, sau khi lê chín 1 tuần, và khi quả lê đã chín già. Những quả lê thu hoạch lần đầu tiên sẽ được ăn cuối cùng. Chính vì cách thu hoạch độc đáo này mà Lê có thể xuất hiện quanh năm trên thị trường, nhưng rộ nhất là thời điểm cuối năm.','thơm, giòn, ngọt, mọng nước','Quả Lê tính lạnh, bình hòa không độc hại, rất giàu vitamin C và pectin là chất giúp làm tăng độ xốp và men vi sinh giúp hệ tiêu hóa ổn định.$Vỏ quả lê có giá trị chữa bệnh cao, có lợi cho tim và phổi, giúp tiêu độc hạ nhiệt. Lê chứa vitamin A, B, C, D và E. Một trái lê có thể cung cấp 10% hàm lượng vitamin C và hàm lượng canxi khá lớn.$Lê mặc dù rất ngọt, song độ nóng và độ ngọt gây béo rất thấp, rất thích hợp với những ai thích ăn ngọt nhưng sợ tăng cân.','Bảo quản ở nhiệt độ 0-4 độ C, có thể bảo quản Lê được hơn 1 tháng','./img_sp/sp1.jpg','Mua nguyên thùng'),(2,'Cherry đỏ Chile ( Thùng 2,5Kg )','thùng',850000,'Chile',5000,'2,5Kg','Được trồng trong những khu vực xinh đẹp này được thiên nhiên ưu đãi với khí hậu hoàn hảo cho quả cherry (quả anh đào): mùa đông dài, sau đó là mùa hè với những ngày khô ấm và ban đêm mát mẻ. Sự thay đổi nhiệt độ ngày và đêm này kéo dài mùa sinh trưởng, cho trái lâu hơn trên cây để tạo ra trái to, giòn, ngon nổi tiếng. Trên thực tế, những quả anh đào của vùng này có hàm lượng Brix (đường) cao nhất so với các loại cherry nước khác.$Quả cherry Chile được thu hoạch nhiều từ cuối tháng 6 đến đầu tháng 9. Giai đoạn giữa mùa, chất lượng quả cherry Chile ngon hơn nhiều so với các loại cherry Úc, Mỹ.','Cherry size to, giòn ngọt.','- Quả cherry rất tốt cho những người bị cao huyết áp. Đây cũng là một trong những loại quả giúp bạn loại bỏ được mức độ cholesterol xấu trong cơ thể.$- Nếu bạn ăn cherry thường xuyên, tình trạng mất ngủ của bạn sẽ được cải thiện. Cherry chứa melatonin làm cho giấc ngủ sâu và ngon hơn.$- Cherry là thực phẩm tốt cho não bộ, tăng trí nhớ bởi chúng chứa các chất chống ôxy hóa anthocyanin.$- Cherry rất tốt cho mắt. Hàm lượng vitamin A có trong cherry nhiều hơn khoảng 20 lần so với dâu tây hay việt quất. Cherry chứa nhiều vitamin A và một phần của vitamin này là beta carotene giúp thúc đẩy tầm nhìn tốt và giữ cho đôi mắt của bạn khỏe mạnh.$- Ăn cherry thường xuyên có thể phòng ngừa ung thư bởi chúng chứa chất chống ôxy hóa có tác dụng ngăn chặn các gốc tự do gây tổn thương tế bào và mô, làm giảm nguy cơ ung thư và chậm quá trình lão hóa.$- Cherry cũng giúp giảm nguy cơ mắc bệnh tiểu đường bởi chất anthocyanin làm tăng khả năng sản sinh insulin.$- Cuối cùng, cherry có khả năng kháng viêm mạnh mẽ. Những bệnh nhân bị viêm khớp hay các vận động viên nếu uống nước trái cây cherry pha loãng 3 lần/ngày, tình trạng sức khỏe sẽ được cải thiện.','• Tránh ánh nắng mặt trời: Nên đặt chúng ở nơi tối, nhiệt độ mát, không nên để anh đào ở những nơi có nhiều ánh nắng mặt trời vì da quả sẽ nhăn lại và không còn thơm ngon như trước nữa.','./img_sp/sp2.jpg','Mua nguyên thùng'),(3,'Cherry đỏ Chile ( Thùng 5Kg )','thùng',1450000,'Chile',5000,'2,5Kg','Được trồng trong những khu vực xinh đẹp này được thiên nhiên ưu đãi với khí hậu hoàn hảo cho quả cherry (quả anh đào): mùa đông dài, sau đó là mùa hè với những ngày khô ấm và ban đêm mát mẻ. Sự thay đổi nhiệt độ ngày và đêm này kéo dài mùa sinh trưởng, cho trái lâu hơn trên cây để tạo ra trái to, giòn, ngon nổi tiếng. Trên thực tế, những quả anh đào của vùng này có hàm lượng Brix (đường) cao nhất so với các loại cherry nước khác.$Quả cherry Chile được thu hoạch nhiều từ cuối tháng 6 đến đầu tháng 9. Giai đoạn giữa mùa, chất lượng quả cherry Chile ngon hơn nhiều so với các loại cherry Úc, Mỹ.','Cherry size to, giòn ngọt.','- Quả cherry rất tốt cho những người bị cao huyết áp. Đây cũng là một trong những loại quả giúp bạn loại bỏ được mức độ cholesterol xấu trong cơ thể.$- Nếu bạn ăn cherry thường xuyên, tình trạng mất ngủ của bạn sẽ được cải thiện. Cherry chứa melatonin làm cho giấc ngủ sâu và ngon hơn.$- Cherry là thực phẩm tốt cho não bộ, tăng trí nhớ bởi chúng chứa các chất chống ôxy hóa anthocyanin.$- Cherry rất tốt cho mắt. Hàm lượng vitamin A có trong cherry nhiều hơn khoảng 20 lần so với dâu tây hay việt quất. Cherry chứa nhiều vitamin A và một phần của vitamin này là beta carotene giúp thúc đẩy tầm nhìn tốt và giữ cho đôi mắt của bạn khỏe mạnh.$- Ăn cherry thường xuyên có thể phòng ngừa ung thư bởi chúng chứa chất chống ôxy hóa có tác dụng ngăn chặn các gốc tự do gây tổn thương tế bào và mô, làm giảm nguy cơ ung thư và chậm quá trình lão hóa.$- Cherry cũng giúp giảm nguy cơ mắc bệnh tiểu đường bởi chất anthocyanin làm tăng khả năng sản sinh insulin.$- Cuối cùng, cherry có khả năng kháng viêm mạnh mẽ. Những bệnh nhân bị viêm khớp hay các vận động viên nếu uống nước trái cây cherry pha loãng 3 lần/ngày, tình trạng sức khỏe sẽ được cải thiện.','• Tránh ánh nắng mặt trời: Nên đặt chúng ở nơi tối, nhiệt độ mát, không nên để anh đào ở những nơi có nhiều ánh nắng mặt trời vì da quả sẽ nhăn lại và không còn thơm ngon như trước nữa.','./img_sp/sp3.jpg','Mua nguyên thùng'),(4,'Nho đen không hạt - Nam Phi','kg',159000,'Nam Phi',5000,'khoảng 2-3 chùm/kg','Đầu thế kỷ 20, Nho đen Nam Phi được trồng tại đất nước giàu có nhất Châu Phi - Cộng Hoà Nam Phi. Ở đây, khí hậu thuận lợi mùa động khô hanh, mùa hè nóng, hệ thống thủy lợi tốt đã tạo điều kiện cho nho phát triển đạt chất lượng và sản lượng tốt nhất.$Thịt nho chắc, vỏ màu đen, trái tròn, mọng nước, ngọt lịm. Cành mỏng manh nhưng rất chắc và tươi lâu. Nho không hạt nên rất thích hợp cho người già và trẻ em.','Nho đen không hạt Nam Phi nổi tiếng với độ Giòn - ngọt lịm - cứng quả. Nho không hạt nên rất thích hợp cho người già và trẻ em.','- Nho đen không hạt Nam Phi có hàm lượng nước cao, chỉ số GI thấp nên rất phù hợp với những bệnh nhân tiểu đường - Nho đen không hạt là loại hoa quả rất giàu dinh dưỡng, có tác dụng bổ tì, ích khí, giúp cơ thể khỏe mạnh, miễn dịch tốt và làm chậm quá trình lão hóa - Canxi, kali, photpho, sắt, vitamin B1, B2, B6, C và các loại axit amin cần thiết tốt cho người suy nhược thần kinh và có lợi cho tiêu hóa - Hợp chất Resveratrol trong nho đen không hạt Nam Phi, đặc biệt là phần vỏ giúp giải độc tốt, giảm máu nhiễm mỡ, chống tụ huyết, phòng chống xơ vỡ động mạch và tăng cường hệ thống miễn dịch của cơ thể.','- Nho đen không hạt Midnight Beauty không tăng độ đường sau khi hái nên chỉ được thu hoạch lúc chín. Nho từng chùm cứng rất đẹp nhưng nhạy cảm và dễ rụng. - Loại nho này tương đối khó bảo quản và chỉ để tươi được vài ngày ở nhiệt độ thường nên phải ăn nhanh. - Cách bảo quản tốt nhất là để nho chưa rửa vào ngăn mát tủ lạnh (nhiệt độ 0 -4 độ C). Cẩn thận để khôn mất đi lớp phấn phủ của nho.','./img_sp/sp4.jpg','Trái cây'),(5,'Táo Fuji Nam Phi','túi',169000,'Nam Phi',5000,'Túi gần 3kg','Táo Fuji được giới thiệu ra thị trường năm 1962, xuất xứ từ Nhật Bản. Giống táo này được lai tạo giữa loại táo Red Delicious và loại táo Ralls Janet. Có trọng lượng khoảng 200g đến 250g mỗi quả, có vỏ ngoài màu đỏ, vỏ nhẵn và trơn. Mặc dù không có hình thức đẹp như Envy hay Rockit nhưng chất lượng rất ngon và giá thành hợp lý, là lựa chọn hàng đầu cho các gia đình để thưởng thức hàng ngày.$Táo Fuji là một trong những loại táo được trồng phổ biến nhất trên khắp thế giới từ Mỹ, New Zealand, Hàn Quốc, Trung Quốc, Nam Phi… với màu sắc và hương vị hơi khác nhau.','Giòn, ngọt thanh','Một quả táo Fuji Nam Phi có thể cung cấp khoảng 4g chất xơ, 8mg vitamin C, 95 Kalo, magie, kẽm, phốtpho và hàm lượng lớn các chất chống oxy. Chúng giúp người sử dụng giảm nguy cơ béo phì, tiểu đường, chống lại bệnh ung thư gan, ung thư vú..$Táo được sử dụng để ăn ngay hoặc làm nước ép uống buổi sáng rất tốt cho sức khoẻ','Táo nên được bảo quản ở nhiệt độ mát trong tủ lạnh từ 0 đến 4 độ C để táo luôn có độ giòn ngọt. Sau khoảng 3 tháng, độ đường tăng cao, độ PSI (độ xốp) sẽ cao hơn làm táo mất độ giòn.','./img_sp/sp5.jpg','Trái cây'),(6,'Nho xanh không hạt Sweet Globe Nam Phi cao cấp','kg',329000,'Nam Phi',5000,'1kg khoảng 2-3 chùm','Nho xanh Sweet Globe hàng cao cấp là hàng được tuyển chọn rất kỹ từ những chùm nho to, đều và đẹp nhất. Nho được hái, bảo quản lạnh và chuyển về Việt Nam trong thời gian sớm nhất, đảo bảo đến tay người tiêu dùng còn tươi rói, cứng quả và ngọt thơm. Sản phẩm thích hợp làm quà tặng hoặ c thưởng thức vào những dịp đặc biệt$Nho xanh Sweet Globe Nam Phi là một trong những chủng loại nho ngon, ngọt nổi tiếng trong số các loại nho ở Nam Phi.$Nho có màu xanh ngọc đẹp mắt. Trái nho dài hơn nho xanh Autumn Crisp. Vị nho giòn ngọt, thanh mát với hàm lượng nước cao. Nho xanh Sweet Globe không có hạt nên rất được người già và trẻ em ưa chuộng.$Được trồng ở Cộng hòa Nam Phi bắt đầu từ năm 1910. Khí hậu tại Nam Phi với mùa đông khô hanh, mùa hè nóng, hệ thống thủy lợi tốt đã tạo điều kiện cho nho phát triển đạt chất lượng và sản lượng tốt nhất.','Giòn ngọt, thanh mát','- Nho xanh là loại hoa quả rất giàu dinh dưỡng, có tác dụng bổ tì, ích khí, giúp cơ thể khỏe mạnh, miễn dịch tốt và làm chậm quá trình lão hóa - Canxi, kali, photpho, sắt, vitamin B1, B2, B6, C và các loại axit amin cần thiết cho người suy nhược thần kinh và có lợi cho tiêu hóa. - Hợp chất Resveratrol trong nho xanh không hạt Mỹ, đặc biệt là phần vỏ giúp giải độc tố, giảm máu nhiễm mỡ, chống tụ huyết, phòng chống xơ vỡ động mạch và tăng cường hệ thống miễn dịch cho cơ thể.','- Nho xanh SweetGlobe Nam Phi không tăng độ đường sau khi hái nên chỉ được thu hoạch lúc chín. Nho từng chùm cứng, rất đẹp nhưng nhạy cảm và dễ rụng. - Loại nho này tương đối khó bảo quản và chỉ để tươi được vài ngày ở nhiệt độ thường nên phải ăn nhanh. - Cách bảo quản tốt nhất là để nho chưa rửa vào ngăn mát tủ lạnh (nhiệt độ 0 -4 độ C). Cẩn thận để không mất đi lớp phấn phủ của nho','./img_sp/sp6.jpg','Trái cây'),(7,'Táo Fuji Nam Phi','kg',79000,'Nam Phi',5000,'Khoảng 5-6 trái/kg','Táo Fuji được giới thiệu ra thị trường năm 1962, xuất xứ từ Nhật Bản. Giống táo này được lai tạo giữa loại táo Red Delicious và loại táo Ralls Janet. Có trọng lượng khoảng 200g đến 250g mỗi quả, có vỏ ngoài màu đỏ, vỏ nhẵn và trơn. Mặc dù không có hình thức đẹp như Envy hay Rockit nhưng chất lượng rất ngon và giá thành hợp lý, là lựa chọn hàng đầu cho các gia đình để thưởng thức hàng ngày.$Táo Fuji là một trong những loại táo được trồng phổ biến nhất trên khắp thế giới từ Mỹ, New Zealand, Hàn Quốc, Trung Quốc, Nam Phi… với màu sắc và hương vị hơi khác nhau.','Giòn, ngọt thanh','Một quả táo Fuji Nam Phi có thể cung cấp khoảng 4g chất xơ, 8mg vitamin C, 95 Kalo, magie, kẽm, phốtpho và hàm lượng lớn các chất chống oxy. Chúng giúp người sử dụng giảm nguy cơ béo phì, tiểu đường, chống lại bệnh ung thư gan, ung thư vú..$Táo được sử dụng để ăn ngay hoặc làm nước ép uống buổi sáng rất tốt cho sức khoẻ','Táo nên được bảo quản ở nhiệt độ mát trong tủ lạnh từ 0 đến 4 độ C để táo luôn có độ giòn ngọt. Sau khoảng 3 tháng, độ đường tăng cao, độ PSI (độ xốp) sẽ cao hơn làm táo mất độ giòn.','./img_sp/sp7.jpg','Trái cây'),(8,'Lê Forella Nam Phi','kg',99000,'Nam Phi',5000,'5-6 trái/kg','Lê Nam Phi có vỏ màu xanh xen lẫn màu vàng có vệt đỏ rực rỡ khi quả chín.$Quả hình chuông nhỏ, tròn và thon đều, bên trong thịt trắng với hương vị thơm mát, ngọt nhẹ.','Quả thuôn dài, giòn, ngọt','Lê Nam Phi có nhiều chất xơ nên rất tốt cho sức khỏe, giảm cholesterol trong cơ thể, ngăn ngừa các bệnh ung thư và tim mạch.$Loại quả này có nguồn Vitamin C tốt tăng cường hệ miễn dịch cho cơ thể đồng thời tham gia sản xuất nhiều tế bào hồng cầu, tạo nhiều máu đỏ$Hàm lượng Vitamen E, hàm lượng Kali trong quả rất cao (50mg trong 100g)$Quả Lê có khả năng phòng chống chứng hay mệt, đồng thời tăng khả năng phòng chống được bệnh tăng huyết áp, sưng, đau họng.','Bảo quản quả lê tốt nhất ở nhiệt độ từ 0oC đến 4oC, để ở nhiệt độ thường 25oC lê sẽ chín sau 1 đến 3 ngày. Nếu để chín quá, lê Nam Phi để lâu sẽ mềm ăn không ngon','./img_sp/sp8.jpg','Trái cây'),(9,'Táo Envy Mỹ Size L Cao Cấp','kg',199000,'Mỹ',5000,'1 kg khoảng 3 -4 trái','- Táo hàng cao cấp là hàng được tuyển chọn rất kỹ từ những quả táo to, đều và đẹp nhất. Táo được hái, bảo quản lạnh và chuyển về Việt Nam trong thời gian sớm nhất, đảo bảo đến tay người tiêu dùng còn tươi rói, cứng quả và ngọt thơm. Sản phẩm thích hợp làm quà tặng hoặc thưởng thức vào những dịp đặc biệt$- Ở Mỹ, tiểu bang Washington là miền cao nguyên phía tây Hoa Kỳ và là vùng sản xuất táo chất lượng tốt nhất thế giới.$- Táo Envy Mỹ thu hoạch từ tháng 10. Sau khi thu hoạch, táo Envy được bảo quản trong kho lạnh CA bằng cách hạ thấp nhiệt độ và nồng độ oxy, vì vậy táo Envy có thể được lưu trữ trong sáu tháng trở lên mà vẫn giữ được độ tươi và giòn trong táo.$- Táo Envy vốn được lai tạo giữa Braeburn và táo Royal Gala tại New Zealand năm 2008. Giống quả này có hình tròn, vỏ màu đỏ, điểm thêm các sọc vàng, thịt giòn, ngọt, thơm nên được nhiều người yêu thích.$- Điểm đặc biệt là táo Envy khi cắt ra không bị thâm, vẫn giữ được màu trắng nên được yêu thích hơn cả trong các dòng Táo.','Thịt giòn, ngọt, thơm','- Táo Envy cung cấp rất nhiều dưỡng chất cho não vì trong táo có một lượng lớn nguyên tố Kẽm (Zn). Kẽm là một nguyên tố không thể thiếu giúp cho não con người hoạt động minh mẫn - Vỏ táo là nơi chứa nhiều lượng vitamin C nhất (chiếm 1/2 tổng lượng Vitamin C của trái táo). Vì thế, người ta hay khuyên ăn táo không nên gọt vỏ. - Táo Envy có mùi thơm đặc trưng, đẳng cấp, kích thích khứu giác khi ăn','- Tại nhà: Táo Envy thường được bảo quản trong ngăn mát tủ lạnh từ 4-8 độ C. Bình thường Táo Envy sẽ giữ được độ tươi trong 1-4 tuần. Sau thời gian này, độ giòn sẽ giảm đi nên táo xốp hơn. Tuỳ khẩu vị của bạn mà có thể ăn Táo ngay lúc còn tươi hay chờ cho táo xốp và mềm hơn. Vì khi xốp thì táo sẽ ngọt hơn so với lúc còn tươi. - Không nên để táo với các thực phẩm có mùi khác như hành tỏi, thịt cá... vì táo dễ bị nhiễm mùi.','./img_sp/sp9.jpg','Mua lẻ'),(10,'Cherry đỏ Chile','kg',379000,'Chile',5000,'Kg','Được trồng trong những khu vực xinh đẹp này được thiên nhiên ưu đãi với khí hậu hoàn hảo cho quả cherry (quả anh đào): mùa đông dài, sau đó là mùa hè với những ngày khô ấm và ban đêm mát mẻ. Sự thay đổi nhiệt độ ngày và đêm này kéo dài mùa sinh trưởng, cho trái lâu hơn trên cây để tạo ra trái to, giòn, ngon nổi tiếng. Trên thực tế, những quả anh đào của vùng này có hàm lượng Brix (đường) cao nhất so với các loại cherry nước khác.$Quả cherry Chile được thu hoạch nhiều từ cuối tháng 6 đến đầu tháng 9. Giai đoạn giữa mùa, chất lượng quả cherry Chile ngon hơn nhiều so với các loại cherry Úc, Mỹ.','Cherry size to, giòn ngọt.','- Quả cherry rất tốt cho những người bị cao huyết áp. Đây cũng là một trong những loại quả giúp bạn loại bỏ được mức độ cholesterol xấu trong cơ thể.$- Nếu bạn ăn cherry thường xuyên, tình trạng mất ngủ của bạn sẽ được cải thiện. Cherry chứa melatonin làm cho giấc ngủ sâu và ngon hơn.$- Cherry là thực phẩm tốt cho não bộ, tăng trí nhớ bởi chúng chứa các chất chống ôxy hóa anthocyanin.$- Cherry rất tốt cho mắt. Hàm lượng vitamin A có trong cherry nhiều hơn khoảng 20 lần so với dâu tây hay việt quất. Cherry chứa nhiều vitamin A và một phần của vitamin này là beta carotene giúp thúc đẩy tầm nhìn tốt và giữ cho đôi mắt của bạn khỏe mạnh.$- Ăn cherry thường xuyên có thể phòng ngừa ung thư bởi chúng chứa chất chống ôxy hóa có tác dụng ngăn chặn các gốc tự do gây tổn thương tế bào và mô, làm giảm nguy cơ ung thư và chậm quá trình lão hóa.$- Cherry cũng giúp giảm nguy cơ mắc bệnh tiểu đường bởi chất anthocyanin làm tăng khả năng sản sinh insulin.$- Cuối cùng, cherry có khả năng kháng viêm mạnh mẽ. Những bệnh nhân bị viêm khớp hay các vận động viên nếu uống nước trái cây cherry pha loãng 3 lần/ngày, tình trạng sức khỏe sẽ được cải thiện.','• Tránh ánh nắng mặt trời: Nên đặt chúng ở nơi tối, nhiệt độ mát, không nên để anh đào ở những nơi có nhiều ánh nắng mặt trời vì da quả sẽ nhăn lại và không còn thơm ngon như trước nữa.','./img_sp/sp10.jpg','Mua lẻ'),(11,'Trà hồng sâm mật ong Hàn Quốc','hũ',199000,'Hàn Quốc',5000,'hũ 580g','Trà hồng sâm mật ong là sự kết hợp giữa hồng sâm 6 năm tuổi tươi xắt lát ngâm với mật ong nguyên chất chính hiệu của Hàn Quốc. Sản phẩm làm từ 100% hồng sâm tươi và mật ong, dùng để uống trực tiếp hoặc với nước nóng làm ấm cơ thể.','Ngọt, thơm mùi sâm','Hồng sâm có công dụng rất hiệu quả trong việc bồi bổ trí não, phát triển tư duy, trí tuệ, tăng cường hệ miễn dịch, hỗ trợ điều trị ung thư, ngăn ngừa lão hóa. Mật ong có tính sát khuẩn cao, giúp thanh lọc đường hô hấp, tránh viêm nhiễm, tăng cường sức khỏe.$Hướng dẫn sử dụng: ngày dùng 2  lần mỗi lần 2 đến 3 thìa cafe (20ml đến 25ml). Khuấy đều trước khi múc ra chén.  Có thể dùng trực tiếp hoặc pha loãng ra với nước. Dùng tốt nhất vào buổi sáng khi vừa ngủ dậy và buổi trưa.','- Bảo quản ở nhiệt độ thường, tránh ánh nắng trực tiếp.$- Sau khi mở nên để ở nơi khô ráo hoặc  tốt nhất nên bảo quản ở ngăn mát tủ lạnh, trắnh ánh nắng trực tiếp.$- Đọc kỹ hướng dẫn sử dụng trước khi dùng.$- Sản phẩm có thể tác dụng khác nhau tuỳ cơ địa của người dùng.$- Sản phẩm không phải là thuốc và không có tác dụng thay thế thuốc chữa bệnh.','./img_sp/sp11.jpg','Mua lẻ'),(12,'Cherry đỏ New size 28+ cao cấp','kg',499000,'New Zealand',5000,'Cherry size 28+','Cherry cao cấp là hàng được tuyển chọn rất kỹ từ những quả cherry to, đều và đẹp nhất. Cherry được hái, bảo quản lạnh và chuyển về Việt Nam trong thời gian sớm nhất, đảo bảo đến tay người tiêu dùng còn tươi rói, cứng quả và ngọt thơm. Sản phẩm thích hợp làm quà tặng hoặc thưởng thức vào những dịp đặc biệt$New Zealand, đặc biệt là khu vực trung tâm Otago, được xem là thủ phủ của cherry (quả anh đào), nơi có rất nhiều nhà vườn sở hữu từ vài chục đến vài trăm hecta cherry. Cherry New Zealand chất lượng bởi nguồn nước tưới tự nhiên rất tinh khiết, khí hậu đạt tiêu chuẩn. Thời điểm vào mùa cherry từ tháng 11 đến tháng 2 hoặc tháng 3, nhiệt độ lý tưởng từ 7 đến 12 độ, lượng mưa ít hoặc không mưa đảm bảo kiểm soát được lượng nước tưới tiêu hợp lý giúp cây phát triển tốt, đúng vụ mùa.$So với cherry Úc thì cherry New Zealand có độ giòn và ngọt tương đương nhưng có màu đỏ đậm và bóng hơn. Dịp tết nguyên đán là thời điểm nhập khẩu cherry từ New Zealand về Việt Nam nhiều nhất vì trùng mùa thu hoạch cherry ở đất nước này. Do vậy giá của cherry New Zealand thường dao động ở mức khá cao, không giảm nhiều như cherry Mỹ.','Quả giòn, ngọt, cuống tươi','- Quả cherry rất tốt cho những người bị cao huyết áp. Đây cũng là một trong những loại quả giúp bạn loại bỏ được mức độ cholesterol xấu trong cơ thể.$- Nếu bạn ăn cherry thường xuyên, tình trạng mất ngủ của bạn sẽ được cải thiện. Cherry chứa melatonin làm cho giấc ngủ sâu và ngon hơn.$- Cherry là thực phẩm tốt cho não bộ, tăng trí nhớ bởi chúng chứa các chất chống ôxy hóa anthocyanin.$- Cherry rất tốt cho mắt. Hàm lượng vitamin A có trong cherry nhiều hơn khoảng 20 lần so với dâu tây hay việt quất. Cherry chứa nhiều vitamin A và một phần của vitamin này là beta carotene giúp thúc đẩy tầm nhìn tốt và giữ cho đôi mắt của bạn khỏe mạnh.$- Ăn cherry thường xuyên có thể phòng ngừa ung thư bởi chúng chứa chất chống ôxy hóa có tác dụng ngăn chặn các gốc tự do gây tổn thương tế bào và mô, làm giảm nguy cơ ung thư và chậm quá trình lão hóa.$- Cherry cũng giúp giảm nguy cơ mắc bệnh tiểu đường bởi chất anthocyanin làm tăng khả năng sản sinh insulin.$- Cuối cùng, cherry có khả năng kháng viêm mạnh mẽ. Những bệnh nhân bị viêm khớp hay các vận động viên nếu uống nước trái cây cherry pha loãng 3 lần/ngày, tình trạng sức khỏe sẽ được cải thiện.','• Tránh ánh nắng mặt trời: Nên đặt chúng ở nơi tối, nhiệt độ mát, không nên để anh đào ở những nơi có nhiều ánh nắng mặt trời vì da quả sẽ nhăn lại và không còn thơm ngon như trước nữa.$• Rửa quả cherry: Nên rửa thật kỹ và sau đó lau khô bằng khăn giấy.','./img_sp/sp12.jpg','Mua lẻ'),(13,'Táo Story (Pháp)','kg',99000,'Pháp',5000,'5 - 6 quả / Kg','Táo story đến từ pháp là dòng trái cây nhập khẩu ngon ngọt được rất nhiều người tiêu dùng lựa chọn. Quả có lớp vỏ màu đỏ của rượu vang đan xen với màu vàng kem bóng bẩy, quả tròn, săn chắc. Thịt táo story với màu trắng kem vô cùng bắt mắt, độ ngọt của táo story thăng bằng giữa đường và axit nên tạo ra một mùi thơm khó cưỡng lại.','o khả năng miễn dịch suy giảm thì táo story chính là giải pháp hữu hiệu giúp ngăn chặn vấn đề này.','Về dinh dưỡng, táo Pháp Story chứa nhiều pectin là một chất xơ hòa tan làm giảm lượng cholesterol và chống oxy hóa, ngăn chặn bệnh tim. Rất nhiều chất xơ vitamin C đều nằm ở trên vỏ táo nên khi sử dụng táo Story chỉ cần rửa sạch bằng nước muối loãng là ăn được ngay không cần gọt vỏ.$Độ kiềm có trong táo Story có tính năng duy trì độ Ph của cơ thể cùng đó làm sạch những chất thải tích tụ trong gan, giúp gan khỏe hơn. Tăng khả năng miễn dịch nếu bị nhiễm trùng hay dị ứng do khả năng miễn dịch suy giảm thì táo story chính là giải pháp hữu hiệu giúp ngăn chặn vấn đề này.','Bảo quản nơi khô ráo và thoáng mát, nhiệt độ khoảng 15 đến 17 độ C là thích hợp nhất. ','./img_sp/sp13.jpg','Mua lẻ'),(14,'Táo Koru Mỹ cao cấp','kg',129000,'Mỹ',5000,'khoảng 4-5 trái/kg','Táo hàng cao cấp là hàng được tuyển chọn rất kỹ từ những quả táo to, đều và đẹp nhất. Táo được hái, bảo quản lạnh và chuyển về Việt Nam trong thời gian sớm nhất, đảo bảo đến tay người tiêu dùng còn tươi rói, cứng quả và ngọt thơm. Sản phẩm thích hợp làm quà tặng hoặc thưởng thức vào những dịp đặc biệt$Táo Koru: giống táo mới được lai tạo bởi người đã lai tạo thành công táo Envy. Nếu Envy ngọt đậm thì táo Koru sẽ thích hợp cho người thích vị ngọt thanh, giòn đanh. Bề ngoài táo có nhiều đường sọc, đỏ đậm đẹp mắt.','Giòn, ngọt thanh','Táo cung cấp chất xơ rất tốt , giúp ổn định lượng đường trong máu, giúp bộ máy tiêu hóa hoạt động tốt. Lượng đường tự nhiên trong táo không làm ảnh hưởng đến bệnh nhân tiểu đường.$Táo Koru Mỹ có hàm lượng axit thấp, là một lựa chon tốt cho trẻ em và người già vì dễ tiêu hoa.$Giống nhiều loại táo khác, táo Koru chứa nhiều chất pectin, đồng thời cũng có nhiều chất xơ hòa tan làm giảm Cholestorol và chất chống oxi hóa. Đây là hai chất rất tốt cho việc phòng ngừa bệnh tim mạch. Hàm lượng vitamin C và A cao hỗ trợ tăng cường hệ miễn dịch cho cơ thể, kích thích ăn ngon và đồng thời tiêu diệt các gốc tự do gây ra bệnh tuổi già hay lão hóa.','- Tại gia đình: nên giữ ở trong tủ lạnh từ 4 đến 8 độ C. Độ tươi và giòn được giữ trong 1- 4 tuần.$- Không nên để chung táo với các loại thực phẩm khác.','./img_sp/sp14.jpg','Trái cây'),(15,'Táo Ambrosia Mỹ size M','kg',99000,'Mỹ',5000,'khoảng 4-5 trái/kg','Táo Ambrosia Mỹ có lớp thịt cực dày, vỏ ngoài căng bóng, ngọt đặc trưng.$Được phát hiện đầu tiên tại thung lũng SImikameen, British Columbia, Canada bởi một cặp vợ chồng. Hiện nay, do đặc tính thơm ngon, giòn đanh, táo Ambrosia được trồng rộng khắp ở Canada và Mỹ, Châu Âu, New Zealand. Những nơi này có khí hậu đêm mát mẻ, ban ngày ấm áp rất thích hợp cho cây táo Ambrosia sinh trưởng và phát triển.','Phần thịt dày, ngọt thanh.','Táo cung cấp chất xơ rất tốt , giúp ổn định lượng đường trong máu, giúp bộ máy tiêu hóa hoạt động tốt. Lượng đường tự nhiên trong táo không làm ảnh hưởng đến bệnh nhân tiểu đường.$Táo Ambrosia Mỹ có hàm lượng axit thấp, là một lựa chon tốt cho trẻ em và người già vì dễ tiêu hoa.$Giống nhiều loại táo khác, táo Ambrosia chứa nhiều chất pectin, đồng thời cũng có nhiều chất xơ hòa tan làm giảm Cholestorol và chất chống oxi hóa. Đây là hai chất rất tốt cho việc phòng ngừa bệnh tim mạch.$Hàm lượng vitamin C và A cao hỗ trợ tăng cường hệ miễn dịch cho cơ thể, kích thích ăn ngon và đồng thời tiêu diệt các gốc tự do gây ra bệnh tuổi già hay lão hóa.','Bảo quản tại nhà trong ngăn mát tủ lạnh từ 4 đến 8 độ C. Táo sẽ giữ độ tươi, ngon trong vòng 1-4 tuần. Sau thời gian này, táo sẽ ngọt hơn, có độ PSI thấp hơn nên táo xốp hơn. Tránh để táo chung với các thực phẩm có mùi khác như hành, tỏi, cá, thịt vì táo dễ nhiễm mùi.','./img_sp/sp15.jpg','Trái cây'),(16,'Táo Envy Mỹ Big size','kg',239000,'Mỹ',5000,'1 kg khoảng 2-3 trái','- Ở Mỹ, tiểu bang Washington là miền cao nguyên phía tây Hoa Kỳ và là vùng sản xuất táo chất lượng tốt nhất thế giới. - Táo Envy Mỹ thu hoạch từ tháng 10. Sau khi thu hoạch, táo Envy được bảo quản trong kho lạnh CA bằng cách hạ thấp nhiệt độ và nồng độ oxy, vì vậy táo Envy có thể được lưu trữ trong sáu tháng trở lên mà vẫn giữ được độ tươi và giòn trong táo. - Táo Envy vốn được lai tạo giữa Braeburn và táo Royal Gala tại New Zealand năm 2008. Giống quả này có hình tròn, vỏ màu đỏ, điểm thêm các sọc vàng, thịt giòn, ngọt, thơm nên được nhiều người yêu thích. - Điểm đặc biệt là táo Envy khi cắt ra không bị thâm, vẫn giữ được màu trắng nên được yêu thích hơn cả trong các dòng Táo.','Thịt giòn, ngọt, thơm','- Táo Envy cung cấp rất nhiều dưỡng chất cho não vì trong táo có một lượng lớn nguyên tố Kẽm (Zn). Kẽm là một nguyên tố không thể thiếu giúp cho não con người hoạt động minh mẫn - Vỏ táo là nơi chứa nhiều lượng vitamin C nhất (chiếm 1/2 tổng lượng Vitamin C của trái táo). Vì thế, người ta hay khuyên ăn táo không nên gọt vỏ. - Táo Envy có mùi thơm đặc trưng, đẳng cấp, kích thích khứu giác khi ăn','- Tại nhà: Táo Envy thường được bảo quản trong ngăn mát tủ lạnh từ 4-8 độ C. Bình thường Táo Envy sẽ giữ được độ tươi trong 1-4 tuần. Sau thời gian này, độ giòn sẽ giảm đi nên táo xốp hơn. Tuỳ khẩu vị của bạn mà có thể ăn Táo ngay lúc còn tươi hay chờ cho táo xốp và mềm hơn. Vì khi xốp thì táo sẽ ngọt hơn so với lúc còn tươi. - Không nên để táo với các thực phẩm có mùi khác như hành tỏi, thịt cá... vì táo dễ bị nhiễm mùi.','./img_sp/sp16.jpg','Trái cây'),(17,'Táo Koru Mỹ','kg',99000,'Mỹ',5000,'khoảng 4-5 trái/kg','Táo Koru: giống táo mới được lai tạo bởi người đã lai tạo thành công táo Envy. Nếu Envy ngọt đậm thì táo Koru sẽ thích hợp cho người thích vị ngọt thanh, giòn đanh. Bề ngoài táo có nhiều đường sọc, đỏ đậm đẹp mắt.','Giòn, ngọt thanh','Táo cung cấp chất xơ rất tốt , giúp ổn định lượng đường trong máu, giúp bộ máy tiêu hóa hoạt động tốt. Lượng đường tự nhiên trong táo không làm ảnh hưởng đến bệnh nhân tiểu đường.$Táo Koru Mỹ có hàm lượng axit thấp, là một lựa chon tốt cho trẻ em và người già vì dễ tiêu hoa.$Giống nhiều loại táo khác, táo Koru chứa nhiều chất pectin, đồng thời cũng có nhiều chất xơ hòa tan làm giảm Cholestorol và chất chống oxi hóa. Đây là hai chất rất tốt cho việc phòng ngừa bệnh tim mạch. Hàm lượng vitamin C và A cao hỗ trợ tăng cường hệ miễn dịch cho cơ thể, kích thích ăn ngon và đồng thời tiêu diệt các gốc tự do gây ra bệnh tuổi già hay lão hóa.','- Tại gia đình: nên giữ ở trong tủ lạnh từ 4 đến 8 độ C. Độ tươi và giòn được giữ trong 1- 4 tuần.$- Không nên để chung táo với các loại thực phẩm khác.','./img_sp/sp17.jpg','Trái cây'),(18,'Táo Grany Smith Mỹ (Táo Xanh)','kg',99000,'Mỹ',5000,'Quả nhỏ, trung bình khoảng 5 – 6 quả/kg','Táo xanh (táo Granny Smith) được phát hiện lần đầu tiên bởi Maria Ann Smith vào năm 1868 tại khu vườn của mình tại Úc. Sau năm 1960, nó được ra mắt thị trường bởi những người Mỹ, sau đó trồng rộng rãi ở Pháp, New Zealand…$Loại táo này bên ngoài có màu xanh phớt hồng, bên trong thịt trắng, nhiều nước và chua hơn những loại táo màu đỏ khác. Do vậy, táo xanh thường được dùng để ép nước, làm salad.$Mùa vụ của loại táo này từ tháng 2 hàng năm. Do được bảo quản bằng công nghệ CA (controlled Atmosphere Storage), táo được bảo quản đến 9 tháng mà vẫn tươi ngon và an toàn cho sức khỏe người dùng.','Nhiều nước, ngọt thanh','- Táo xanh cung cấp rất nhiều dưỡng chất cho não vì trong táo có một lượng lớn nguyên tố Kẽm (Zn). Kẽm là một nguyên tố không thể thiếu giúp cho não con người hoạt động minh mẫn.$- Vỏ táo là nơi chứa nhiều lượng vitamin C nhất (chiếm 1/2 tổng lượng Vitamin C của trái táo). Vì thế, người ta hay khuyên ăn táo không nên gọt vỏ.$- Táo xanh được dùng ép nước hoặc làm salad rất ngon','Bảo quản trong tủ lạnh gia đình ở nhiệt độ từ 4 đến 8 độ C, táo sẽ giữ được độ tươi, giòn trong vòng 1 – 4 tuần.$Sau khoảng thời gian này chất lượng sẽ giảm dần, ví dụ như: độ giòn giảm, quả héo,… Tuy nhiên càng để lâu thì trái sẽ càng ngọt hơn nhưng không giòn nữa.','./img_sp/sp18.jpg','Trái cây'),(19,'Lê Nâu Hàn Quốc Size L','kg',169000,'Hàn Quốc',5000,'khoảng 850g/trái','Quả Lê Hàn Quốc hình dạng tròn đẹp mắt với màu vỏ hơi nâu vàng, thịt quả trắng, giòn, ngọt, nhiều nước. Lê Hàn Quốc là loại quả được người Hàn Quốc ưa chuộng và chọn lựa cho những hộp quà đẳng cấp. Size quả lớn, đẹp và ngon chất lượng, loại lê này đã có mặt trên khắp thế giới.$Những người nông dân sẽ thu hoạch Lê Hàn Quốc vào 3 thời điểm khác nhau: trước khi lê chín khoảng 2 tuần, sau khi lê chín 1 tuần, và khi quả lê đã chín già. Những quả lê thu hoạch lần đầu tiên sẽ được ăn cuối cùng. Chính vì cách thu hoạch độc đáo này mà Lê có thể xuất hiện quanh năm trên thị trường, nhưng rộ nhất là thời điểm cuối năm.','thơm, giòn, ngọt, mọng nước','Quả Lê tính lạnh, bình hòa không độc hại, rất giàu vitamin C và pectin là chất giúp làm tăng độ xốp và men vi sinh giúp hệ tiêu hóa ổn định.$Vỏ quả lê có giá trị chữa bệnh cao, có lợi cho tim và phổi, giúp tiêu độc hạ nhiệt. Lê chứa vitamin A, B, C, D và E. Một trái lê có thể cung cấp 10% hàm lượng vitamin C và hàm lượng canxi khá lớn.$Lê mặc dù rất ngọt, song độ nóng và độ ngọt gây béo rất thấp, rất thích hợp với những ai thích ăn ngọt nhưng sợ tăng cân.','Bảo quản ở nhiệt độ 0-4 độ C, có thể bảo quản Lê được hơn 1 tháng','./img_sp/sp19.jpg','Trái cây'),(20,'Hồng quả sấy dẻo','hộp (500g)',199000,'Hàn Quốc',5000,'Đóng hộp 550g','Hồng dẻo Hàn Quốc được sấy khô theo phương pháp tự nhiên 100% dưới nắng mặt trời. Sản phẩm hồng sấy khô của vùng Jeondo, tỉnh Gyeongbuk nổi tiếng được làm từ những quả hồng không hạt duy nhất của Hàn Quốc. Chất lượng trái hồng ở đây được đánh giá là thơm ngon bậc nhất Hàn Quốc. Quả hồng được sấy khô tự nhiên có màu cam đậm, bên ngoài có một lớp phấn trắng tự nhiên chính là đường trong quả.$Hồng dẻo được người Hàn Quốc ưa thích và tặng nhau vào những dịp quan trọng trong năm. Vừa thưởng thức miếng hồng khô dẻo quánh, ngọt lịm vừa nhâm nhi ly trà nóng thật thích nên hồng dẻo cũng là món ăn vặt ưa thích của nhiều người.','Thịt mềm dẻo, vị ngọt, không hạt','- Quả hồng sấy khô có lượng vitamin A, vitamin C và protein, canxi cao hơn nhiều so với các loại trái cây khác. Vì thế nó là món ăn vặt được ưa chuộng cho những người bị huyết áp cao, bệnh nhân ung thư, đi tiểu khó…$- Hồng sấy có tác dụng xoa dịu thần kinh, giúp con người tỉnh táo, tăng hiệu quả làm việc. Đường thực vật trong hồng rất bổ ích với những người bị bệnh tim mạch.$- Giúp chế ngự cơn đói rất tốt mà không có nhiều calories, bởi vậy các nhà dinh dưỡng khuyên những người thừa cân nên bổ sung vào khẩu phần ăn của mình.','Hồng quả sấy dẻo thường được bảo quản trong ngăn đông ở nhiệt độ -10 độ C. Khi lấy ra ăn, nên bỏ vào ngăn mát tủ lạnh ở nhiệt độ 3-5 độ C và sử dụng hết trong vòng 7 ngày.','./img_sp/sp20.jpg','Trái cây'),(21,'Hồng giòn Hàn Quốc','kg',79000,'Hàn Quốc',5000,'1 kg khoảng 4 trái','Quả hồng có hình vuông dẹt, kích thước to. Vỏ màu vàng đậm đẹp mắt. Thịt quả hồng Hàn Quốc rất giòn, ngọt, nhiều nước, đặc biệt không chát như hồng Việt Nam nên rất dễ ăn.$Hồng giòn được trồng theo phương pháp hữu cơ ở các nông trại trên núi cao. Với khí hậu trong lành và đất nhiều dinh dưỡng, các trang trại hồng luôn nhộn nhịp người thu hoạch, khách tham quan mua hồng tận vườn vào mỗi dịp mùa hồng về.$Thời gian thu hoạch hồng giòn là mùa thu từ cuối tháng 9 đến đầu tháng 12. Sau khi thu hái, hồng được đóng trực tiếp vào các hộp, các túi hoặc thùng carton đưa đi tiêu thụ hoặc cho vào kho lạnh. Một phần hồng được sấy khô bằng máy, không thêm hóa chất để làm hồng khô.$Hồng là loại trái cây rất ngon và được người Hàn ưa thích vì vị ngon, mẫu mã đẹp, có nhiều dinh dưỡng, được dùng ăn hàng ngày hoặc dâng cúng, biếu tặng vào các dịp lễ tết.','Vị ngọt, giòn, không hạt','- Hàm lượng vitamin C rất cao khoảng 7mg/100g thịt quả, 83,5% là nước có tách dụng phục hồi và giải khát cơ thể.$- Tiền vitamin A 1,40mg/100g – là chất chống oxy hóa mạnh có khả năng chống lại bệnh tim mạch, ngăn ngừa sự phát triển của bệnh ung thư$- Vitamin B1, vitamin B9 đóng vai trò quan trọng để duy trì và tăng cường hệ thần kinh làm việc hiệu quả$- Potassium – khoáng chất có tính thanh lọc, giúp đào thải độc tố và cặn bã trong cơ thể$- Ngoài ra còn có chất xơ, calicium, phốt pho, magie, protein, carbon, chất béo,…','Hống sẽ tươi và cứng lâu hơn ở nhiệt độ phòng từ 20-25 độ C. Khi để trong ngăn mát tủ lạnh, hồng sẽ mau chín và mềm hơn.','./img_sp/sp21.jpg','Trái cây'),(22,'Lê Nâu Hàn Quốc Size M','kg',99000,'Hàn Quốc',5000,'khoảng 650-750g/trái','Quả Lê Hàn Quốc hình dạng tròn đẹp mắt với màu vỏ hơi nâu vàng, thịt quả trắng, giòn, ngọt, nhiều nước. Lê Hàn Quốc là loại quả được người Hàn Quốc ưa chuộng và chọn lựa cho những hộp quà đẳng cấp. Size quả lớn, đẹp và ngon chất lượng, loại lê này đã có mặt trên khắp thế giới.$Những người nông dân sẽ thu hoạch Lê Hàn Quốc vào 3 thời điểm khác nhau: trước khi lê chín khoảng 2 tuần, sau khi lê chín 1 tuần, và khi quả lê đã chín già. Những quả lê thu hoạch lần đầu tiên sẽ được ăn cuối cùng. Chính vì cách thu hoạch độc đáo này mà Lê có thể xuất hiện quanh năm trên thị trường, nhưng rộ nhất là thời điểm cuối năm.','thơm, giòn, ngọt, mọng nước',' Quả Lê tính lạnh, bình hòa không độc hại, rất giàu vitamin C và pectin là chất giúp làm tăng độ xốp và men vi sinh giúp hệ tiêu hóa ổn định.$Vỏ quả lê có giá trị chữa bệnh cao, có lợi cho tim và phổi, giúp tiêu độc hạ nhiệt. Lê chứa vitamin A, B, C, D và E. Một trái lê có thể cung cấp 10% hàm lượng vitamin C và hàm lượng canxi khá lớn.$Lê mặc dù rất ngọt, song độ nóng và độ ngọt gây béo rất thấp, rất thích hợp với những ai thích ăn ngọt nhưng sợ tăng cân.','Bảo quản ở nhiệt độ 0-4 độ C, có thể bảo quản Lê được hơn 1 tháng','./img_sp/sp22.jpg','Trái cây'),(23,'Xuân đào trắng Úc','kg',149000,'Úc',5000,'1kg khoảng 5-6 quả','Xuân đào Úc (đào Úc) được trồng nhiều ở các bang phía nam, phía tây của Australia nơi có khí hậu ôn đới, ấm áp tạo điều kiện tốt nhất cho xuân đào phát triển và cho quả đạt chất lượng cao.$Xuân đào Úc có 2 loại là đào trắng và đào vàng do sự khác biệt một chút về màu sắc bên ngoài vỏ. Đào trắng có màu hồng phớt đặc trưng của trái đào. Trong khi đào vàng có hình dáng và vỏ của trái mận, ít lông, màu đỏ đẹp mắt.$Về vị, cả 2 loại đào đều rất thơm, giòn chắc, mọng nước nhưng đào vàng thì hơi có vị chua nhẹ, đào trắng hoàn toàn có vị ngọt không chua.','Giòn, thơm, ngọt thanh','Trong trái đào có chứa rất nhiều năng lượng, protein, chất xơ và các vitamin như A, C… vượt trội so với các loại trái cây khác$- Hàm lượng chất xơ rất cao có lợi cho sức khỏe tim mạch và tốt cho hệ tiêu hóa$- Sắt trong xuân đào Úc rất nhiều tham gia sản xuất các thế bào hồng cầu, thúc đẩy tái tạo máu và ngăn ngừa thiếu máu$- Hydrocyanic axit và benzoic aldehyde được tìm thấy trong đào là sản phẩm thủy phân của amygdalin có tác dụng phòng chống bệnh ung thư rất hiệu quả$- Xuân đào Úc có chứa hàm lượng cao beta caroten chất chống oxy hóa chuyển thành vitamin A giúp sáng mắt, làm sạch và giải độc thận.','Xuân đào Úc có thể tươi ngon trong vòng 2 tuần nếu bảo quản tốt trong điều kiện tủ mát.','./img_sp/sp23.jpg','Trái cây'),(24,'Cherry đỏ Úc size 28+','kg',499000,'Úc',5000,'Cherry size 28','Quả cherry còn được biết đến với tên gọi là \"quả anh đào\". Là một loại cây thuộc cây thân gỗ, nhiều cành nhánh, sống lâu năm và có chiều cao lên đến 10m. Cherry mọc thành chùm trên cuống dài. Ban đầu quả cherry có màu xanh, khi chín có màu đỏ mọng, màu vàng hoặc đen, đường kính quả khoảng 2,5cm.$Cherry Úc có vỏ giòn, đỏ hơi tím, không bóng như cherry Mỹ. Tuy nhiên, chất lượng của cherry được đánh giá là ngon hơn hẳn các loại cherry các nước về độ ngọt. Hơn nữa, cherry Úc là mùa cherry được chờ đợi nhất trong năm vì gần đến mùa Giáng Sinh và Tết cổ truyền của Việt Nam. Rất thích hợp cho việc biếu tặng và thưởng thức vào dịp sum họp với bạn bè, gia đình. Chủng Sweetheart (được gọi như vậy chắc là do trái có hình kiểu quả tim) được ưa chuộng nhất ở thị trường nước ngoài.$Cherry Úc có thể được đóng thùng 5kg, 9kg hoặc trong hộp carton 2kg để dành làm quà tặng.','Quả giòn, ngọt, cuống tươi','- Quả cherry rất tốt cho những người bị cao huyết áp. Đây cũng là một trong những loại quả giúp bạn loại bỏ được mức độ cholesterol xấu trong cơ thể.$- Nếu bạn ăn cherry thường xuyên, tình trạng mất ngủ của bạn sẽ được cải thiện. Cherry chứa melatonin làm cho giấc ngủ sâu và ngon hơn.$- Cherry là thực phẩm tốt cho não bộ, tăng trí nhớ bởi chúng chứa các chất chống ôxy hóa anthocyanin.$- Cherry rất tốt cho mắt. Hàm lượng vitamin A có trong cherry nhiều hơn khoảng 20 lần so với dâu tây hay việt quất. Cherry chứa nhiều vitamin A và một phần của vitamin này là beta carotene giúp thúc đẩy tầm nhìn tốt và giữ cho đôi mắt của bạn khỏe mạnh.$- Ăn cherry thường xuyên có thể phòng ngừa ung thư bởi chúng chứa chất chống ôxy hóa có tác dụng ngăn chặn các gốc tự do gây tổn thương tế bào và mô, làm giảm nguy cơ ung thư và chậm quá trình lão hóa.$- Cherry cũng giúp giảm nguy cơ mắc bệnh tiểu đường bởi chất anthocyanin làm tăng khả năng sản sinh insulin.$- Cuối cùng, cherry có khả năng kháng viêm mạnh mẽ. Những bệnh nhân bị viêm khớp hay các vận động viên nếu uống nước trái cây cherry pha loãng 3 lần/ngày, tình trạng sức khỏe sẽ được cải thiện.','• Tránh ánh nắng mặt trời: Nên đặt chúng ở nơi tối, nhiệt độ mát, không nên để anh đào ở những nơi có nhiều ánh nắng mặt trời vì da quả sẽ nhăn lại và không còn thơm ngon như trước nữa.$• Rửa quả cherry: Bạn nên rửa thật kỹ và sau đó lau khô bằng khăn giấy.','./img_sp/sp24.jpg','Trái cây'),(25,'Táo Rockit L4','ống',119000,'New Zealand',5000,'1 ống 4 trái','- Táo Rockit là dòng táo có nguồn gốc xuất xứ từ vịnh Hawke của New Zealand với hình dáng nhỏ, vỏ ngoài màu hồng đậm pha chút sắc vàng, là sự kết hợp giữa nhiều loại táo khác nhau để tạo nên nét độc đáo và sự riêng biệt. Táo rockit căng bóng và cầm rất chắc tay, thịt chắc giòn, hàm lượng nước cao, vị ngọt đậm.$- Táo Rockit phải trải qua thời gian nuôi trồng và chăm sóc kéo dài tới ba năm mới có thể thu hoạch được những quả táo ngon nhất, nhưng ngày nay chúng đã được nhân giống ở nhiều nơi trên thế giới.','Vị ngọt, giòn và nhiều nước','Một quả táo cung cấp nhiều chất xơ, giúp giảm cholesterol.$Vỏ táo chứa Axit Ursolic giúp thúc đẩy cơ thể đốt cháy calo, tăng việc hình thành cơ và giảm chất béo trong cơ thể.','- Giữ trong ngăn mát tủ lạnh từ 4 đến 8 độ C$- Táo giữ được độ tươi, độ giòn trong vòng 1-4 tuần.','./img_sp/sp25.jpg','Trái cây'),(26,'Dưa lưới giống Nhật - Việt Nam','kg',79000,'Việt Nam',5000,'1 trái khoảng 1.4 - 2.5kg trở lên','Dưa lưới giống Nhật được cấy ghép và trồng tại VN, còn gọi là dưa vàng, có hình tròn hoặc dài, da màu xanh pha gân lưới trắng.$Thịt quả có màu vàng cam hoặc vàng đỏ rất bắt mắt, ăn giòn, mát và thơm ngọt. Một trái có cân nặng từ 1.3-2.5kg','Giòn, mát và thơm ngọt.','Dưa lưới là nguồn chứa chất chống oxy hóa dạng polyphenol, giúp phòng, chống bệnh ung thư và tăng cường hoạt động miễn dịch.$Trong dưa chứa nhiều chất xơ nên tác dụng nhuận trường, chống táo bón. Dưa còn là nguồn phong phú beta-carotene, acid folic, kali và vitamin C, A. Nước ép dưa lưới có thể giúp cải thiện tình trạng khó thở, giảm được sự mệt mỏi, chữa được chứng mất ngủ, rất có lợi cho người mang thai, thai nhi, giúp ngăn ngừa chứng loãng xương, giúp hạ huyết áp, ngăn chặn chứng chuột rút ở chân.$Dưa lưới là trái cây giàu folate, một loại vitamin có vai trò quan trọng cho sức khỏe của tim, đồng thời ngăn chặn những khuyết tật ở thai nhi. Khi mua, nên chọn trái nặng tay, đó là dấu hiệu của dưa ngọt. Cuống bị rụng hay trái nứt là dưa vừa chín tới. Dưới lưới sẽ tiếp tục chính sau khi hái nên sau khi hái ở vườn hoặc mua về, bạn nên để thêm 1- 2 ngày để cuống dưa héo mới bổ ra ăn.','Với công nghệ trồng dưa hiện nay, thời gian dưa tươi tương đối dài, từ 7-10 ngày trong nhiệt độ bình thường. Tuy nhiên, sau khi bổ ra, nên để trong ngăn mát, ăn hết trong ngày để giữ nguyên hương vị thơm ngon.','./img_sp/sp26.jpg','Trái cây'),(27,'Táo Ambrosia Canada Size M sale','kg',129000,'Canada',5000,'khoảng 4-5 trái/kg','Quả táo hàng sales có ít lỗi ở quả như có đốm, vết xước hoặc có thời hạn lưu kho lâu nhưng không ảnh hưởng đến chất lượng quả.$Táo Ambrosia Canada có lớp thịt cực dày, vỏ ngoài căng bóng, ngọt đặc trưng.$Được phát hiện đầu tiên tại thung lũng SImikameen, British Columbia, Canada bởi một cặp vợ chồng. Hiện nay, do đặc tính thơm ngon, giòn đanh, táo Ambrosia được trồng rộng khắp ở Canada và Mỹ, Châu Âu, New Zealand. Những nơi này có khí hậu đêm mát mẻ, ban ngày ấm áp rất thích hợp cho cây táo Ambrosia sinh trưởng và phát triển.','Phần thịt dày, ngọt thanh.','Táo cung cấp chất xơ rất tốt , giúp ổn định lượng đường trong máu, giúp bộ máy tiêu hóa hoạt động tốt. Lượng đường tự nhiên trong táo không làm ảnh hưởng đến bệnh nhân tiểu đường.$Táo Ambrosia Canada có hàm lượng axit thấp, là một lựa chon tốt cho trẻ em và người già vì dễ tiêu hoa.$Giống nhiều loại táo khác, táo Ambrosia chứa nhiều chất pectin, đồng thời cũng có nhiều chất xơ hòa tan làm giảm Cholestorol và chất chống oxi hóa. Đây là hai chất rất tốt cho việc phòng ngừa bệnh tim mạch.$Hàm lượng vitamin C và A cao hỗ trợ tăng cường hệ miễn dịch cho cơ thể, kích thích ăn ngon và đồng thời tiêu diệt các gốc tự do gây ra bệnh tuổi già hay lão hóa.','Bảo quản tại nhà trong ngăn mát tủ lạnh từ 4 đến 8 độ C. Táo sẽ giữ độ tươi, ngon trong vòng 1-4 tuần. Sau thời gian này, táo sẽ ngọt hơn, có độ PSI thấp hơn nên táo xốp hơn. Tránh để táo chung với các thực phẩm có mùi khác như hành, tỏi, cá, thịt vì táo dễ nhiễm mùi.','./img_sp/sp27.jpg','Trái cây'),(28,'Táo Ambrosia Canada Size L Cao cấp','kg',139000,'Canada',5000,'khoảng 3-4 trái/kg','Táo hàng cao cấp là hàng được tuyển chọn rất kỹ từ những quả táo to, đều và đẹp nhất. Táo được hái, bảo quản lạnh và chuyển về Việt Nam trong thời gian sớm nhất, đảo bảo đến tay người tiêu dùng còn tươi rói, cứng quả và ngọt thơm. Sản phẩm thích hợp làm quà tặng hoặc thưởng thức vào những dịp đặc biệt$Táo Ambrosia Canada có lớp thịt cực dày, vỏ ngoài căng bóng, ngọt đặc trưng.$Được phát hiện đầu tiên tại thung lũng SImikameen, British Columbia, Canada bởi một cặp vợ chồng. Hiện nay, do đặc tính thơm ngon, giòn đanh, táo Ambrosia được trồng rộng khắp ở Canada và Mỹ, Châu Âu, New Zealand. Những nơi này có khí hậu đêm mát mẻ, ban ngày ấm áp rất thích hợp cho cây táo Ambrosia sinh trưởng và phát triển.','Phần thịt dày, ngọt thanh.','Táo cung cấp chất xơ rất tốt , giúp ổn định lượng đường trong máu, giúp bộ máy tiêu hóa hoạt động tốt. Lượng đường tự nhiên trong táo không làm ảnh hưởng đến bệnh nhân tiểu đường. Táo Ambrosia Canada có hàm lượng axit thấp, là một lựa chon tốt cho trẻ em và người già vì dễ tiêu hoa. Giống nhiều loại táo khác, táo Ambrosia chứa nhiều chất pectin, đồng thời cũng có nhiều chất xơ hòa tan làm giảm Cholestorol và chất chống oxi hóa. Đây là hai chất rất tốt cho việc phòng ngừa bệnh tim mạch. Hàm lượng vitamin C và A cao hỗ trợ tăng cường hệ miễn dịch cho cơ thể, kích thích ăn ngon và đồng thời tiêu diệt các gốc tự do gây ra bệnh tuổi già hay lão hóa.','Bảo quản tại nhà trong ngăn mát tủ lạnh từ 4 đến 8 độ C. Táo sẽ giữ độ tươi, ngon trong vòng 1-4 tuần. Sau thời gian này, táo sẽ ngọt hơn, có độ PSI thấp hơn nên táo xốp hơn. Tránh để táo chung với các thực phẩm có mùi khác như hành, tỏi, cá, thịt vì táo dễ nhiễm mùi.','./img_sp/sp28.jpg','Trái cây'),(29,'Nho đỏ có hạt Peru','kg',169000,'Chile',5000,'khoảng 2-3 chùm/kg','Nho Peru được người Mỹ đánh giá cao do có độ ngọt cao, trái cây rất sạch.$Có khoảng 9 giống nho được trồng ở đất nước này, phục vụ trong nước và xuất khẩu. Trong đó nho đỏ có hạt cũng là một loại nho được yêu thích vì nho Peru vẫn giữ được độ giòn, ngọt, không mềm và ngọt thanh như các loại nho có hạt các nước.$Hầu hết các vườn nho của Peru nằm ở bờ biển trung tâm, xung quanh Pisco và Ica, nơi diễn ra hầu hết các hoạt động sản xuất rượu vang và chưng cất của Peru. Lợi thế của khí hậu Peru có phần nhỉnh hơn do có bờ biển khô và 12 giờ có ánh sáng mặt trời hàng ngày, kết hợp hệ thống tưới tiêu kịp thời, đầy đủ, các vụ nho ở Peru trưởng thành nhanh hơn 55% so với các nước láng giềng nhu Chi Lê, Argentina.$Mùa thu hoạch thường bắt đầu vào cuối tháng 10 và kết thúc vào cuối tháng 4.','Ngọt thanh, mọng nước, giòn vừa','- Hạt nho có chứa proantho-cyanidin, chất chống oxy hóa có tác dụng ngăn chặn sự phát triển của nhiều bệnh nan y, chống xơ vữa động mạch và quá trình lão hóa sớm.$- Nho đỏ có hàm lượng nước cao, chỉ số GI thấp nên rất phù hợp với những bệnh nhân tiểu đường$- Nho đỏ có hạt là loại hoa quả rất giàu dinh dưỡng, có tác dụng bổ tì, ích khí, giúp cơ thể khỏe mạnh, miễn dịch tốt và làm chậm quá trình lão hóa$- Canxi, kali, photpho, sắt, vitamin B1, B2, B6, C và các loại axit amin cần thiết tốt cho người suy nhược thần kinh và có lợi cho tiêu hóa$- Hợp chất Resveratrol trong nho đỏ, đặc biệt là phần vỏ giúp giải độc tốt, giảm máu nhiễm mỡ, chống tụ huyết, phòng chống xơ vỡ động mạch và tăng cường hệ thống miễn dịch của cơ thể.','- Nho đỏ Peru không tăng độ đường sau khi hái nên chỉ được thu hoạch lúc chín. Nho từng chùm cứng rất đẹp nhưng nhạy cảm và dễ rụng.$- Loại nho này tương đối khó bảo quản và chỉ để tươi được vài ngày ở nhiệt độ thường nên phải ăn nhanh.$- Cách bảo quản tốt nhất là để nho chưa rửa vào ngăn mát tủ lạnh (nhiệt độ 0 -4 độ C). Cẩn thận để khôn mất đi lớp phấn phủ của nho.','./img_sp/sp29.jpg','Trái cây'),(30,'Nho xanh không hạt Peru','kg',249000,'Peru',5000,'khoảng 2-3 chùm/kg','Nho Peru được người Mỹ đánh giá cao do có độ ngọt cao, trái cây rất sạch.$Có khoảng 9 giống nho được trồng ở đất nước này, phục vụ trong nước và xuất khẩu. Trong đó, nho xanh không hạt cũng là một loại nho được yêu thích vì nho Peru có độ giòn, ngọt như các loại nho không hạt của các nước khác.$Hầu hết các vườn nho của Peru nằm ở bờ biển trung tâm, xung quanh Pisco và Ica, nơi diễn ra hầu hết các hoạt động sản xuất rượu vang và chưng cất của Peru. Lợi thế của khí hậu Peru có phần nhỉnh hơn do có bờ biển khô và 12 giờ có ánh sáng mặt trời hàng ngày, kết hợp hệ thống tưới tiêu kịp thời, đầy đủ, các vụ nho ở Peru trưởng thành nhanh hơn 55% so với các nước láng giềng nhu Chi Lê, Argentina.$Mùa thu hoạch thường bắt đầu vào cuối tháng 10 và kết thúc vào cuối tháng 4.','Giòn tan, Vỏ mỏng, Ngọt đậm vị','- Đây là giống nho cho ra sản lượng cao nhất của Peru và có hương vị phù hợp với nhiều người. Nho xnah Peru có hình dáng thuôn dài, màu xanh hổ phách bắt mắt. Có lẽ đây cũng là dòng nho được nhiều người ưu chuộng bởi vị ngọt mát, có vị thơm khi cắn, rất giòn và đặc biệt không có hạt.$- Nho xanh không hạt là loại hoa quả rất giàu dinh dưỡng, có tác dụng bổ tì, ích khí, giúp cơ thể khỏe mạnh, miễn dịch tốt và làm chậm quá trình lão hóa$- Canxi, kali, photpho, sắt, vitamin B1, B2, B6, C và các loại axit amin cần thiết tốt cho người suy nhược thần kinh và có lợi cho tiêu hóa$- Hợp chất Resveratrol trong nho đỏ, đặc biệt là phần vỏ giúp giải độc tốt, giảm máu nhiễm mỡ, chống tụ huyết, phòng chống xơ vỡ động mạch và tăng cường hệ thống miễn dịch của cơ thể.','- Nho xanh Peru không tăng độ đường sau khi hái nên chỉ được thu hoạch lúc chín. Nho từng chùm cứng rất đẹp nhưng nhạy cảm và dễ rụng.$- Loại nho này tương đối khó bảo quản và chỉ để tươi được vài ngày ở nhiệt độ thường nên phải ăn nhanh.$- Cách bảo quản tốt nhất là để nho chưa rửa vào ngăn mát tủ lạnh (nhiệt độ 0 -4 độ C). Cẩn thận để khôn mất đi lớp phấn phủ của nho.','./img_sp/sp30.jpg','Trái cây'),(31,'Nho khô hộp Raisins - Mỹ','hộp',99000,'Mỹ',5000,'1 hộp 425g','Nho khô Sunview được sấy khô từ 3 loại nhỏ đỏ, nho đen, nho xanh. Không như những loại nho khác, nho khô Sunview được tuyển chọn từ những trái nho tươi, trái to, qua quy trình sấy khô, trộn, bỏ cuống, bù nước làm ẩm nho tránh khô cứng... để cho ra đời \"siêu phẩm Nho khô Sunview\".','Không ngọt khé cổ, rất vừa ăn.','- Nho khô Sunview Raisins chứa vitamin, khoáng chất, và là chất chống oxy hóa tuyệt vời, có thể ngăn ngừa ung thư, tốt cho tiêu hóa, tăng cường năng lượng và hệ thống miễn dịch, đồng thời làm đẹp da, tóc... Nho đặc biệt tốt cho phụ nữ mang thai và trẻ em.','Để nơi khô ráo thoáng mát, tránh nhiệt độ cao và ánh sáng mặt trời','./img_sp/sp31.jpg','Đồ khô'),(32,'Combo Trà gừng - Trà chanh - Đào ngâm','combo',350000,'Hàn Quốc',5000,'1 combo có 3 lọ (3 loại)','Combo gồm 3 loại là 3 lọ với dung tích như sau: trà gừng mật ong 1kg, trà chanh mật ong 1 kg, đào ngâm 680g$Trà gừng mật ong bao gồm: Gừng thái lát, mật ong, Đường biotic fructose (đường thấp năng lượng tăng cường tiêu hóa), đường, acid citric, vitamin C…$Trà chanh mật ong gồm: chanh xắt sợi, mật ong, đường biotic fructose (đường thấp năng lượng tăng cường tiêu hóa), đường, acid citric, vitamin C…$Đào ngâm được làm từ đào tươi cắt miếng và đường tốt cho sức khỏe.','Sản phẩm có vị ngọt, thơm','Trà Gừng mật ong, trà chanh mật ong là sản phẩm truyền thống của Hàn Quốc, được chiết xuất từ gừng tươi và gừng cắt lát Hàn Quốc. Mật ong ngọt nguyên chất. Rất tốt cho sức khỏe cho cả người lớn và trẻ em.$Giúp cơ thể tiết mồ hôi.$Đào thải các chất độc hại trong cơ thể.$Phòng ngừa cảm cúm hay giảm ho…','Dùng theo hạn sử dụng trên sản phẩm. Sau khi mở nên bảo quản trong ngăn mát để dùng được lâu hơn, ngon hơn','./img_sp/sp32.jpg','Combo'),(33,'Táo Fuji Nam Phi','túi',160000,'Nam Phi',5000,'Túi gần 3kg','Táo Fuji được giới thiệu ra thị trường năm 1962, xuất xứ từ Nhật Bản. Giống táo này được lai tạo giữa loại táo Red Delicious và loại táo Ralls Janet. Có trọng lượng khoảng 200g đến 250g mỗi quả, có vỏ ngoài màu đỏ, vỏ nhẵn và trơn. Mặc dù không có hình thức đẹp như Envy hay Rockit nhưng chất lượng rất ngon và giá thành hợp lý, là lựa chọn hàng đầu cho các gia đình để thưởng thức hàng ngày.$Táo Fuji là một trong những loại táo được trồng phổ biến nhất trên khắp thế giới từ Mỹ, New Zealand, Hàn Quốc, Trung Quốc, Nam Phi… với màu sắc và hương vị hơi khác nhau.','Giòn, ngọt thanh','Một quả táo Fuji Nam Phi có thể cung cấp khoảng 4g chất xơ, 8mg vitamin C, 95 Kalo, magie, kẽm, phốtpho và hàm lượng lớn các chất chống oxy. Chúng giúp người sử dụng giảm nguy cơ béo phì, tiểu đường, chống lại bệnh ung thư gan, ung thư vú..$Táo được sử dụng để ăn ngay hoặc làm nước ép uống buổi sáng rất tốt cho sức khoẻ','Táo nên được bảo quản ở nhiệt độ mát trong tủ lạnh từ 0 đến 4 độ C để táo luôn có độ giòn ngọt. Sau khoảng 3 tháng, độ đường tăng cao, độ PSI (độ xốp) sẽ cao hơn làm táo mất độ giòn.','./img_sp/sp33.jpg','Trái cây'),(34,'Cherry đỏ Mỹ size 9','Kg',650000,'Mỹ',5000,'Kg','Quả cherry (quả anh đào) Mỹ là loại cho chất lượng đa dạng nhất từ màu sắc, hương vị tới giá trị dinh dưỡng. Quả cherry Mỹ thường to, ngọt thanh. Thịt chắc, giòn, mọng nước, màu đỏ thẫm, hạt dễ tróc.$Về màu sắc, cherry có 3 loại theo màu sắc khác nhau: cherry đỏ (thường hơi chua, quả màu đỏ tươi), cherry đen (vị ngọt đậm, đỏ ngả sang tím đậm), cherry vàng là giống cherry có vị ngọt hơn các loại khác, giá thành thường cao và sản lượng ít hơn cherry đỏ.$Về chủng loại, cherry nói chung có các loại phổ biến được ưa chuộng tại VN như: Bings (số lượng nhiều nhất, ngọt thanh), Skenna (quả to, ngọt và ngon nhất), Lapin, Chelan (vị hơi dôn dốt), Sweetheart (quả hình trái tim, ngọt), Rainier (cherry vàng, ngọt).$Cherry Mỹ ở California có mùa vụ từ tháng 5 đến tháng 6 và ở Washington có mùa vụ từ tháng 6 đến cuối tháng 7.','Quả size vừa, giòn ngọt.','- Quả cherry rất tốt cho những người bị cao huyết áp. Đây cũng là một trong những loại quả giúp bạn loại bỏ được mức độ cholesterol xấu trong cơ thể.$- Nếu bạn ăn cherry thường xuyên, tình trạng mất ngủ của bạn sẽ được cải thiện. Cherry chứa melatonin làm cho giấc ngủ sâu và ngon hơn.$- Cherry là thực phẩm tốt cho não bộ, tăng trí nhớ bởi chúng chứa các chất chống ôxy hóa anthocyanin.$- Cherry rất tốt cho mắt. Hàm lượng vitamin A có trong cherry nhiều hơn khoảng 20 lần so với dâu tây hay việt quất. Cherry chứa nhiều vitamin A và một phần của vitamin này là beta carotene giúp thúc đẩy tầm nhìn tốt và giữ cho đôi mắt của bạn khỏe mạnh.$- Ăn cherry thường xuyên có thể phòng ngừa ung thư bởi chúng chứa chất chống ôxy hóa có tác dụng ngăn chặn các gốc tự do gây tổn thương tế bào và mô, làm giảm nguy cơ ung thư và chậm quá trình lão hóa.$- Cherry cũng giúp giảm nguy cơ mắc bệnh tiểu đường bởi chất anthocyanin làm tăng khả năng sản sinh insulin.$- Cuối cùng, cherry có khả năng kháng viêm mạnh mẽ. Những bệnh nhân bị viêm khớp hay các vận động viên nếu uống nước trái cây cherry pha loãng 3 lần/ngày, tình trạng sức khỏe sẽ được cải thiện.','• Tránh ánh nắng mặt trời: Nên đặt chúng ở nơi tối, nhiệt độ mát, không nên để anh đào ở những nơi có nhiều ánh nắng mặt trời vì da quả sẽ nhăn lại và không còn thơm ngon như trước nữa. • Rửa quả cherry: Bạn nên rửa thật kỹ và sau đó lau khô bằng khăn giấy.','./img_sp/sp34.jpg','Trái cây'),(35,'Táo Envy Mỹ Size L','kg',220000,'Mỹ',5000,'1 kg khoảng 2-3 trái','- Ở Mỹ, tiểu bang Washington là miền cao nguyên phía tây Hoa Kỳ và là vùng sản xuất táo chất lượng tốt nhất thế giới. - Táo Envy Mỹ thu hoạch từ tháng 10. Sau khi thu hoạch, táo Envy được bảo quản trong kho lạnh CA bằng cách hạ thấp nhiệt độ và nồng độ oxy, vì vậy táo Envy có thể được lưu trữ trong sáu tháng trở lên mà vẫn giữ được độ tươi và giòn trong táo. - Táo Envy vốn được lai tạo giữa Braeburn và táo Royal Gala tại New Zealand năm 2008. Giống quả này có hình tròn, vỏ màu đỏ, điểm thêm các sọc vàng, thịt giòn, ngọt, thơm nên được nhiều người yêu thích. - Điểm đặc biệt là táo Envy khi cắt ra không bị thâm, vẫn giữ được màu trắng nên được yêu thích hơn cả trong các dòng Táo.','Thịt giòn, ngọt, thơm','- Táo Envy cung cấp rất nhiều dưỡng chất cho não vì trong táo có một lượng lớn nguyên tố Kẽm (Zn). Kẽm là một nguyên tố không thể thiếu giúp cho não con người hoạt động minh mẫn - Vỏ táo là nơi chứa nhiều lượng vitamin C nhất (chiếm 1/2 tổng lượng Vitamin C của trái táo). Vì thế, người ta hay khuyên ăn táo không nên gọt vỏ. - Táo Envy có mùi thơm đặc trưng, đẳng cấp, kích thích khứu giác khi ăn','- Tại nhà: Táo Envy thường được bảo quản trong ngăn mát tủ lạnh từ 4-8 độ C. Bình thường Táo Envy sẽ giữ được độ tươi trong 1-4 tuần. Sau thời gian này, độ giòn sẽ giảm đi nên táo xốp hơn. Tuỳ khẩu vị của bạn mà có thể ăn Táo ngay lúc còn tươi hay chờ cho táo xốp và mềm hơn. Vì khi xốp thì táo sẽ ngọt hơn so với lúc còn tươi. - Không nên để táo với các thực phẩm có mùi khác như hành tỏi, thịt cá... vì táo dễ bị nhiễm mùi.','./img_sp/sp35.jpg','Trái cây'),(36,'Táo đỏ Red Delicious Mỹ','kg',120000,'Mỹ',5000,'1 kg khoảng 3 trái','Táo Red Delicious hình trái tim với lớp vỏ bên ngoài có đôi khi có sọc, màu đỏ booc - đô quyến rũ và ngon lành đúng như tên của nó. Nguồn gốc của loại táo này vẫn chưa được biết, chỉ biết chúng được phát hiện như là một cây giống ngẫu nhiên trong một nông trại ở Peru năm 1875. Ban đầu được biết đến với tên gọi là Hawkeye. Đây là một trong những giống táo được nhập vào Việt Nam đầu tiên.$Táo Red Delicious thường được dùng để làm món tráng miệng, làm đồ ăn nhẹ hoặc làm nguyên liệu trong chế biến salad.$Ở Mỹ, táo Red Delicious được trồng chủ yếu ở tiểu bang Washington bởi thổ nhưỡng ở đây màu mỡ do dung nham núi lửa cùng khí hậu khô nóng nên ít có côn trùng, dịch bệnh. Ngoài ra, nhờ nguồn nước dồi dào từ sông Columbia và vùng núi Cascade, Washington có hệ thống tưới tiêu lý tưởng cho việc trồng táo. Loại táo này ảnh hưởng rất lớn đến nghành trồng táo của bang Washington.','Mọng nước, ngọt dịu','- Táo cung cấp rất nhiều dưỡng chất cho não vì trong táo có một lượng lớn nguyên tố Kẽm (Zn). Kẽm là một nguyên tố không thể thiếu giúp cho não con người hoạt động minh mẫn.$- Vỏ táo là nơi chứa nhiều lượng vitamin C nhất (chiếm 1/2 tổng lượng Vitamin C của trái táo). Vì thế, người ta hay khuyên ăn táo không nên gọt vỏ.','- Táo thường được bảo quản trong ngăn mát tủ lạnh từ 4-8 độ C. Bình thường, táo sẽ giữ được độ tươi trong 1-4 tuần. Sau thời gian này, độ giòn sẽ giảm đi nên táo xốp hơn. Tuỳ khẩu vị của bạn mà có thể ăn táo ngay lúc còn tươi hay chờ cho táo xốp và mềm hơn. Vì khi xốp, táo sẽ ngọt hơn so với lúc còn tươi.$- Không nên để táo với các thực phẩm có mùi khác như hành tỏi, thịt cá... vì táo dễ bị nhiễm mùi.','./img_sp/sp36.jpg','Trái cây'),(37,'Táo Koru Mỹ','kg',110000,'Mỹ',5000,'khoảng 4-5 trái/kg','Táo Koru: giống táo mới được lai tạo bởi người đã lai tạo thành công táo Envy. Nếu Envy ngọt đậm thì táo Koru sẽ thích hợp cho người thích vị ngọt thanh, giòn đanh. Bề ngoài táo có nhiều đường sọc, đỏ đậm đẹp mắt.','Giòn, ngọt thanh','Táo cung cấp chất xơ rất tốt , giúp ổn định lượng đường trong máu, giúp bộ máy tiêu hóa hoạt động tốt. Lượng đường tự nhiên trong táo không làm ảnh hưởng đến bệnh nhân tiểu đường.$Táo Koru Mỹ có hàm lượng axit thấp, là một lựa chon tốt cho trẻ em và người già vì dễ tiêu hoa.$Giống nhiều loại táo khác, táo Koru chứa nhiều chất pectin, đồng thời cũng có nhiều chất xơ hòa tan làm giảm Cholestorol và chất chống oxi hóa. Đây là hai chất rất tốt cho việc phòng ngừa bệnh tim mạch. Hàm lượng vitamin C và A cao hỗ trợ tăng cường hệ miễn dịch cho cơ thể, kích thích ăn ngon và đồng thời tiêu diệt các gốc tự do gây ra bệnh tuổi già hay lão hóa.','- Tại gia đình: nên giữ ở trong tủ lạnh từ 4 đến 8 độ C. Độ tươi và giòn được giữ trong 1- 4 tuần.$- Không nên để chung táo với các loại thực phẩm khác.','./img_sp/sp37.jpg','Trái cây'),(38,'Lê Nâu Hàn Quốc Size L','kg',150000,'Hàn Quốc',5000,'khoảng 850g/trái','Quả Lê Hàn Quốc hình dạng tròn đẹp mắt với màu vỏ hơi nâu vàng, thịt quả trắng, giòn, ngọt, nhiều nước. Lê Hàn Quốc là loại quả được người Hàn Quốc ưa chuộng và chọn lựa cho những hộp quà đẳng cấp. Size quả lớn, đẹp và ngon chất lượng, loại lê này đã có mặt trên khắp thế giới.$Những người nông dân sẽ thu hoạch Lê Hàn Quốc vào 3 thời điểm khác nhau: trước khi lê chín khoảng 2 tuần, sau khi lê chín 1 tuần, và khi quả lê đã chín già. Những quả lê thu hoạch lần đầu tiên sẽ được ăn cuối cùng. Chính vì cách thu hoạch độc đáo này mà Lê có thể xuất hiện quanh năm trên thị trường, nhưng rộ nhất là thời điểm cuối năm.','thơm, giòn, ngọt, mọng nước','Quả Lê tính lạnh, bình hòa không độc hại, rất giàu vitamin C và pectin là chất giúp làm tăng độ xốp và men vi sinh giúp hệ tiêu hóa ổn định.$Vỏ quả lê có giá trị chữa bệnh cao, có lợi cho tim và phổi, giúp tiêu độc hạ nhiệt. Lê chứa vitamin A, B, C, D và E. Một trái lê có thể cung cấp 10% hàm lượng vitamin C và hàm lượng canxi khá lớn.$Lê mặc dù rất ngọt, song độ nóng và độ ngọt gây béo rất thấp, rất thích hợp với những ai thích ăn ngọt nhưng sợ tăng cân.','Bảo quản ở nhiệt độ 0-4 độ C, có thể bảo quản Lê được hơn 1 tháng','./img_sp/sp38.jpg','Trái cây'),(39,'Nho xanh không hạt Autumn Crisp Úc','kg',200000,'Úc',5000,'2-3 chùm/kg','Úc nổi tiếng với khí hậu và thổ nhưỡng thích hợp với các giống nho. Nho xanh giống Autumn Crisp là một trong những giống nho xanh giòn, ngọt được yêu thích bởi hình dáng quả đẹp (vỏ mỏng, căng mọng), thịt quả dày, mọng nước, giòn như cà pháo.','Quả cực giòn, ngọt, không chát','Cứ 100g thịt quả nho sẽ cho 71 calo, 10 – 12g đường dễ hấp thụ, 11mg vitamin C đáp ứng 18% nhu cầu hàng ngày. Bên cạnh đó, nho xanh không hạt Úc còn chứa nhiều polyphenol, resveratrol chất chống oxy hóa mạnh có tác dụng chống lại các gốc tự do. Bảo vệ tế bào phòng chống nhiều bệnh ung thư, chống lại quá trình lão hóa,...$Nho xanh giúp gan dọn sạch lượng độc tố có hại trong cơ thể, có ích cho quá trình tái tạo máu, do có nhiều nhiều nước, kali cao (có tác dụng lợi tiểu), giàu chất xơ (thúc đẩy quá trình tiêu hóa).','Có thể giữ nho tươi và ngon lâu trong ngăn mát tủ lạnh đến 1 tuần. Nên bỏ vào hộp nhựa an toàn hoặc bỏ vào túi nilông có lỗ thoáng khí, tránh xa các thực phẩm gây mùi. Ăn đến đâu, rửa đến đó để tránh Nho không bị ủng, mau hư.','./img_sp/sp39.jpg','Trái cây'),(40,'Quýt Úc','kg',120000,'Úc',5000,'Trái 180g','Quýt Úc được trồng rộng rãi ở miền Nam nước Úc, đặc biêt là vùng Queensland, nơi có khí hậu nhiệt đới và cận nhiệt đới.$Quýt Úc có hình quả tròn, màu vàng ươm, các đốm tinh dầu to bóng, quả hơi dẹt. Thịt mọng nước, vị ngọt thanh, không hạt. Mùa của Quýt Úc thường kéo dài đến tháng 10 hàng năm.','Ngọt thanh, mọng nước','Trong quả Quýt có chứa thành phần chống oxy hoá, tăng cường khả năng miễn dịch, chống sự phát triển của khối u bướu. Ngoài ra, Quýt cũng có nhiều vitamin A và Beta Crarotin giúp bảo vệ da. Các chất Acid hữu cơ và vitamin trong Quýt điều hoà chức năng trao đổi chất trong cơ thể, đặc biệt là cho người mắc bệnh tim mạch.','Để bảo quản Quýt còn giữ nguyên hàm lượng vitamin trong vòng 2 tuần là trong nhiệt độ từ 5 đến 10 độ C. Cách tốt nhất để bảo quản Quýt là để tự nhiên thay vì cho vào túi nhựa vì khi tiếp xúc với độ ẩm, Quýt dễ bị mốc. Không nên ép nước để bị thất thoát vitamin, thường dùng ăn tươi.','./img_sp/sp40.jpg','Trái cây'),(41,'Cam ruột vàng Ai Cập','kg',80000,'Ai Cập',5000,'Khoảng 3-4 trái/kg','Ai Cập là nước có diện tích trồng cam lớn thứ 6 trên thế giới và đứng đầu về sản lượng xuất khẩu hàng năm. Cam Ai Cập được biết đến nhiều nhất là giống cam Valencia phổ biến trên thế giới, bên cạnh các giống cam khác như: Jaffa, Cara., Navel, Late Navel. Loại cam này có đặc điểm trái tròn, vỏ mỏng, ngọt thanh và tép cam ráo, không quá nhiều nước thích hợp để cắt ăn hoặc trộn chung với các món salad.$Mùa cam Ai Cập từ giữa tháng 11 và có thể vẫn còn xuất hiện đến tháng 7 năm sau nhờ phương pháp bảo quản lạnh rất tốt mà không làm ảnh hưởng chất lượng của quả cam.','Ngọt thanh, nhiều tép','- Cam chứa rất nhiều vitamin C giúp nâng cao sức đề kháng, phòng ngừa nhiều bệnh lây nhiễm, bảo vệ tế bào khỏi quá trình lão hóa.$- Chất xơ cao giúp kiểm soát lượng cholesterol xấu trong cơ thể, bảo vệ tim mạch, làm sạch đường ruột, ngăn ngừa ung thư và các bệnh về tiêu hóa.$- Vitamin A, E, khoáng chất: sắt, magie, kali,… dồi dào trong quả cam giúp sáng mắt, bổ máu làm giảm tình trạng chóng mặt và thúc đẩy quá trình trao đổi chất trong cơ thể.','Bảo quản trong ngăn mát tủ lanh nhiệt độ từ 0-4 độ C','./img_sp/sp41.jpg','Trái cây'),(42,'Táo Rockit L4','ống',120000,'New Zealand',5000,'1 ống 4 trái','- Táo Rockit là dòng táo có nguồn gốc xuất xứ từ vịnh Hawke của New Zealand với hình dáng nhỏ, vỏ ngoài màu hồng đậm pha chút sắc vàng, là sự kết hợp giữa nhiều loại táo khác nhau để tạo nên nét độc đáo và sự riêng biệt. Táo rockit căng bóng và cầm rất chắc tay, thịt chắc giòn, hàm lượng nước cao, vị ngọt đậm.$- Táo Rockit phải trải qua thời gian nuôi trồng và chăm sóc kéo dài tới ba năm mới có thể thu hoạch được những quả táo ngon nhất, nhưng ngày nay chúng đã được nhân giống ở nhiều nơi trên thế giới.','Vị ngọt, giòn và nhiều nước','Một quả táo cung cấp nhiều chất xơ, giúp giảm cholesterol.$Vỏ táo chứa Axit Ursolic giúp thúc đẩy cơ thể đốt cháy calo, tăng việc hình thành cơ và giảm chất béo trong cơ thể.','- Giữ trong ngăn mát tủ lạnh từ 4 đến 8 độ C$- Táo giữ được độ tươi, độ giòn trong vòng 1-4 tuần.','./img_sp/sp42.jpg','Trái cây'),(43,'Kiwi Ruột Vàng Newzealand','kg',200000,'New Zealand',5000,'Khoảng 150- 250g/trái','Kiwi được trồng nhiều ở vùng đảo phía Bắc và Nam New Zealand.$Kiwi vàng có đài ở đầu quả, vỏ nâu vàng, trơn nhẵn, thịt màu vàng, nhiều hạt đen tạo nên vòng tròn xung quanh trục quả, trông đẹp mắt.$Có vị ngọt hơn nên kiwi vàng được ưa chuộng hơn và có giá thành cao hơn kiwi xanh.$Mùa vụ Kiwi từ tháng 5 đến tháng 11.','Thịt mềm, ngọt thanh.','- Kiwi cung cấp dồi dào Vitamin C, E, kali và chất xơ, sắt, magie,... tốt cho hệ miễn dịch, phòng ngừa viêm gan, nâng cao sự miễn dịch, chống liệt dương. - Chứa nhiều chất chống oxy hóa mạnh, ít calo và không chứa cholesterol, phòng tránh ung thư và tim mạch, thuận lợi cho tiêu hóa, kiểm soát huyết áp,... - Kiwi vàng rất giàu dinh dưỡng và vitamin E. - Một quả Kiwi cung cấp được 1/3 năng lượng cần cho một ngày.','- Kiwi chín nếu để vào tủ lạnh sẽ giữ thêm được 5-7 ngày. - Ngon hơn khi để lạnh. - Cách ăn ngon nhất là bổ quả kiwi làm đôi và dùng thìa múc. Bằng cách ăn này sẽ hạn chế dập quả và ăn hết phần thịt của quả.','./img_sp/sp43.jpg','Trái cây'),(44,'Hộp quà tặng - 107','hộp',200000,'Mỹ',5000,'hộp khoảng 1.5-2kg','Hộp quà tặng trái cây gồm những loại trái cây nhập khẩu như: táo, cam, nho, dưa lưới, kiwi.... màu sắc đẹp, trang nhã, bắt mắt. Với giỏ quà kích thước vừa phải, đựng vừa đủ các loại trái cây mà không quá cầu kỳ như các loại giỏ quà khác.','Các loại trái cây có vị ngọt thanh, mọng nước, tươi ngon.','Trái cây có chứa nhiều vitamin như A, E, C giúp hỗ trợ tim mạch, chống lão hoá, tốt cho làn da, tóc và hệ tiêu hoá. Ăn các loại trái cây thường xuyên giúp cơ thể khoẻ mạnh, tăng sức đề kháng chống lại bệnh tật, bệnh truyền nhiễm.','Bảo quản giỏ quà trái cây trong tủ mát (đặc biệt đối với nho, kiwi) hoặc trong phòng có máy lạnh để trái cây được tươi ngon, giữ nguyên chất dinh dưỡng trong trái.','./img_sp/sp44.jpg','Giỏ quà tặng trái cây'),(45,'Hộp quà tặng - 108','hộp',400000,'Mỹ',5000,'hộp khoảng 2 kg','Hộp quà tặng trái cây gồm những loại trái cây nhập khẩu như: táo, cam, nho, dưa lưới, kiwi.... màu sắc đẹp, trang nhã, bắt mắt. Với giỏ quà kích thước vừa phải, đựng vừa đủ các loại trái cây mà không quá cầu kỳ như các loại giỏ quà khác.','Các loại trái cây có vị ngọt thanh, mọng nước, tươi ngon.','Trái cây có chứa nhiều vitamin như A, E, C giúp hỗ trợ tim mạch, chống lão hoá, tốt cho làn da, tóc và hệ tiêu hoá. Ăn các loại trái cây thường xuyên giúp cơ thể khoẻ mạnh, tăng sức đề kháng chống lại bệnh tật, bệnh truyền nhiễm.','Bảo quản giỏ quà trái cây trong tủ mát (đặc biệt đối với nho, kiwi) hoặc trong phòng có máy lạnh để trái cây được tươi ngon, giữ nguyên chất dinh dưỡng trong trái.','./img_sp/sp45.jpg','Giỏ quà tặng trái cây'),(46,'Giỏ quà tặng VIP - 106','Giỏ',950000,'Nhiều nước',5000,'Khoảng 3-4 kg','- Giỏ quà tặng trái cây cao cấp gồm những loại trái cây nhập khẩu như: Táo, cam, nho, dưa lưới, kiwi.... màu sắc đẹp, trang nhã, bắt mắt. Hình thức lịch sự, sang trọng rất thích hợp để biếu tặng trong những dịp lễ, tết, khai trương ... hoặc những ngày đặc biệt trong năm.$- Đối với những loại trái cây hết hàng, hết mùa ngay tại thời điểm khách đặt chúng tôi sẽ thay thế sản phẩm tương thích cùng chủng loại hoặc sản phẩm khác phù hợp.$- Nếu khách hàng có nhu cầu muốn chọn loại hoa quả cũng như số lượng trong giỏ quà tặng hãy liên hệ trực tiếp với F5 Fruithsop để được nhân viên tư vấn chính xác nhất.','Ngọt thanh, mọng nước','Trái cây có chứa nhiều vitamin như A, E, C giúp hỗ trợ tim mạch, chống lão hoá, tốt cho làn da, tóc và hệ tiêu hoá. Ăn các loại trái cây thường xuyên giúp cơ thể khoẻ mạnh, tăng sức đề kháng chống lại bệnh tật, bệnh truyền nhiễm.','Bảo quản giỏ quà trái cây trong tủ mát (đặc biệt đối với nho) hoặc trong phòng có máy lạnh để trái cây được tươi ngon, giữ nguyên chất dinh dưỡng trong trái.','./img_sp/sp46.jpg','Giỏ quà tặng trái cây'),(47,'Giỏ quà tặng - 102','Giỏ',700000,'Nhiều nước',5000,'Khoảng 3 - 4 kg','Giỏ quà tặng trái cây gồm những loại trái cây nhập khẩu như: táo, cam, nho, dưa lưới, kiwi.... màu sắc đẹp, trang nhã, bắt mắt. Với giỏ quà kích thước vừa phải, đựng vừa đủ các loại trái cây mà không quá cầu kỳ như các loại giỏ quà khác. Tùy theo từng mùa mà chủng loại hoa quả sẽ khác nhau.','Ngọt thanh, mọng nước','Trái cây có chứa nhiều vitamin như A, E, C giúp hỗ trợ tim mạch, chống lão hoá, tốt cho làn da, tóc và hệ tiêu hoá. Ăn các loại trái cây thường xuyên giúp cơ thể khoẻ mạnh, tăng sức đề kháng chống lại bệnh tật, bệnh truyền nhiễm.','Bảo quản giỏ quà trái cây trong tủ mát (đặc biệt đối với nho, kiwi) hoặc trong phòng có máy lạnh để trái cây được tươi ngon, giữ nguyên chất dinh dưỡng trong trái.','./img_sp/sp47.jpg','Giỏ quà tặng trái cây'),(48,'Giỏ quà tặng VIP - 107','Giỏ',850000,'Nhiều nước',5000,'Khoảng 3-4 kg','- Giỏ quà tặng trái cây cao cấp gồm những loại trái c