','hộp',400000,'Mỹ',5000,'hộp khoảng 1.5-2kg','Hộp quà tặng trái cây gồm những loại trái cây nhập khẩu cao cấp như: Lê HQ, táo, nho với màu sắc đẹp, trang nhã, bắt mắt. Không quá to như giỏ quà, hộp quà tặng thích hợp cho các dịp tặng nhẹ nhàng như sinh nhật, thăm ốm...','Ngọt thanh, mọng nước','Trái cây có chứa nhiều vitamin như A, E, C giúp hỗ trợ tim mạch, chống lão hoá, tốt cho làn da, tóc và hệ tiêu hoá. Ăn các loại trái cây thường xuyên giúp cơ thể khoẻ mạnh, tăng sức đề kháng chống lại bệnh tật, bệnh truyền nhiễm.','Bảo quản trái cây trong tủ mát (đặc biệt đối với nho) hoặc trong phòng có máy lạnh để trái cây được tươi ngon, giữ nguyên chất dinh dưỡng trong trái.','./img_sp/sp63.jpg','Giỏ quà tặng trái cây'),(64,'Hộp quà tặng - 106','hộp',400000,'Nhiều nước',5000,'hộp khoảng 1.5-2kg','Hộp quà tặng trái cây gồm những loại trái cây nhập khẩu như: táo, nho, đào ngâm HQ với màu sắc đẹp, trang nhã, bắt mắt. Với hộp quà kích thước vừa phải, đựng vừa đủ các loại trái cây mà không quá cầu kỳ như các loại giỏ quà khác.','Ngọt thanh, mọng nước','Trái cây có chứa nhiều vitamin như A, E, C giúp hỗ trợ tim mạch, chống lão hoá, tốt cho làn da, tóc và hệ tiêu hoá. Ăn các loại trái cây thường xuyên giúp cơ thể khoẻ mạnh, tăng sức đề kháng chống lại bệnh tật, bệnh truyền nhiễm.','Bảo quản hộp quà trái cây trong tủ mát (đặc biệt đối với nho) hoặc trong phòng có máy lạnh để trái cây được tươi ngon, giữ nguyên chất dinh dưỡng trong trái.','./img_sp/sp64.jpg','Giỏ quà tặng trái cây'),(65,'Giỏ quà tặng - 108','Giỏ',650000,'Nhiều nước',5000,'Khoảng 3-4 kg','Giỏ quà tặng trái cây chỉ gồm cam với màu sắc đẹp, trang nhã, bắt mắt. Với giỏ quà kích thước vừa phải, đựng vừa đủ mà không quá cầu kỳ như các loại giỏ quà khác.','Ngọt thanh, mọng nước','Trái cây có chứa nhiều vitamin như A, E, C giúp hỗ trợ tim mạch, chống lão hoá, tốt cho làn da, tóc và hệ tiêu hoá. Ăn các loại trái cây thường xuyên giúp cơ thể khoẻ mạnh, tăng sức đề kháng chống lại bệnh tật, bệnh truyền nhiễm.','Bảo quản giỏ quà trái cây trong tủ mát hoặc trong phòng có máy lạnh để trái cây được tươi ngon, giữ nguyên chất dinh dưỡng trong trái.','./img_sp/sp65.jpg','Giỏ quà tặng trái cây'),(66,'Hạnh nhân trà sữa','túi',99000,'Hàn Quốc',5000,'túi 180g','Gói có hình hạt hạnh nhân và ly trà sữa hấp dẫn. Thiết kế gói rất sang trọng chứa 180g hạt hạnh nhân được sấy khô tẩm ướp hương vị của trà sữa.','Vị bùi, ngọt và thơm mùi trà sữa','Các nghiên cứu khoa học đã chỉ ra rằng trong 1 chén hạt hạnh nhân có 45g chất béo trong đó 28 g là chất béo không bão hòa đơn, 11g chất béo không bão hòa đa và chỉ có 3,4 g chất béo bão hòa.$Hàm lượng protein cao, chất béo tốt và chất xơ phong phú chính là điều kiện lý tưởng để phát huy tác dụng của hạt hạnh nhân  trong việc hỗ trợ giảm cân rất tuyệt vời.$Trong hạt hạnh nhân chứa nhiều chất chống oxy hóa như flavonoid có trong các loại rau củ, trái cây, trà xanh.$Flavonoid là chất chống oxy hóa mạnh giúp loại bỏ các gốc tự do gây hại cho cơ thể và làm cho chúng ta già đi.$Ngoài ra, hạnh nhân có chứa dồi dào lượng Vitamin A, E, B và các khoáng chất Đồng, Magie, Mangan...','Luôn để hạt hạnh nhân ở những nơi khô ráo, mát mẻ, có độ ẩm thích hợp và tránh tiếp xúc trực tiếp với ánh nắng mặt trời. Cũng như hạnh nhân tươi, bảo quản hạnh nhân khô cũng dùng các lọ thuỷ tinh để đựng và đậy nắp vào rồi cho vào ngăn mát tủ lạnh.','./img_sp/sp66.jpg','Đồ khô'),(67,'Nho khô hộp Raisins - Mỹ','hộp',109000,'Mỹ',5000,'1 hộp 425g','Nho khô Sunview được sấy khô từ 3 loại nhỏ đỏ, nho đen, nho xanh. Không như những loại nho khác, nho khô Sunview được tuyển chọn từ những trái nho tươi, trái to, qua quy trình sấy khô, trộn, bỏ cuống, bù nước làm ẩm nho tránh khô cứng... để cho ra đời \"siêu phẩm Nho khô Sunview\".','Không ngọt khé cổ, rất vừa ăn.','- Nho khô Sunview Raisins chứa vitamin, khoáng chất, và là chất chống oxy hóa tuyệt vời, có thể ngăn ngừa ung thư, tốt cho tiêu hóa, tăng cường năng lượng và hệ thống miễn dịch, đồng thời làm đẹp da, tóc... Nho đặc biệt tốt cho phụ nữ mang thai và trẻ em.','Để nơi khô ráo thoáng mát, tránh nhiệt độ cao và ánh sáng mặt trời','./img_sp/sp67.jpg','Đồ khô'),(68,'Trà Đào','lọ',79000,'Hàn Quốc',5000,'1 lọ 680g','Đào ngâm Hàn Quốc nổi tiếng với hương vị ngọt không gắt cổ, sản phẩm làm từ những trái đào tươi ngon được trồng tại vườn nơi có khí hậu mát mẻ và nguồn nước trong lành của vùng Gyeonggi - Do (Hàn Quốc). Nơi đây có nông trại trồng đào khá lớn và nổi tiếng, sản lượng đào nhiều và được sản xuất theo quy chuẩn, rất an toàn và ngon.$Với công nghệ nấu chín và đóng hộp khép kín tuân thủ đầy đủ vệ sinh an toàn thực phẩm, sản phẩm đào ngâm hoàn toàn không dùng chất bảo quản, rất an toàn cho người sử dụng.','Thơm, ngọt, 100% đào tươi','ĐÀO NGÂM HÀN QUỐC được nhập khẩu chính ngạch từ nhà phân phối NH TRADING CO., LTD Hàn Quốc - Công ty trực thuộc Bộ Nông nghiệp Hàn Quốc.$✔️ Trộn sữa chua bạn có ngay 1 cốc sữa chua đào thơm ngon, dùng được cho cả mẹ và bé$✔️ Pha với trà Lipton bạn có ngay 1 cốc trà đào thơm mát, giải nhiệt...$✔️ Trang trí bánh kem và ăn kèm đỡ ngậy.$? Trái đào giàu vitamin A và có chất chống oxy hoá rất mạnh,giúp kiểm soát các gốc tự do,hạn chế sự hình thành các tế bào ung thư.$? Hương vị đậm đà.$? Không sử dụng hoá chất , ko phẩm màu.$? Được sản xuất trên dây chuyền hiện đại qui trình khép kín đảm bảo chất lượng và mùi vị thơm ngon.','Bảo quản ở nơi khô ráo, thoáng mát. Tránh nhiệt độ quá cao hoặc quá thấp. Khi mở ra nên cho vào tủ lạnh để bảo quản và ăn hết trong vòng 3-4 ngày.','./img_sp/sp68.jpg','Đồ khô'),(69,'Chanh Mật Ong','lọ',135000,'Hàn Quốc',5000,'Lọ 1 kg','Trà chanh mật ong gồm: chanh xắt sợi, mật ong, đường biotic fructose (đường thấp năng lượng tăng cường tiêu hóa), đường, acid citric .... Mỗi ngày pha uống với nước nóng, có thể thêm đá, uống rất tốt cho sức khỏe. Sản phẩm có thể dùng như mứt, ăn kèm với bánh mì sanwich rất ngon.','Ngọt, thơm mùi chanh, gừng.','Chanh mật ong là sản phẩm truyền thống của Hàn Quốc, được chiết xuất từ gừng tươi và gừng cắt lát Hàn Quốc. Mật ong ngọt nguyên chất. Rất tốt cho sức khỏe cho cả người lớn và trẻ em.$Giúp cơ thể tiết mồ hôi.$Đào thải các chất độc hại trong cơ thể.$Phòng ngừa cảm cúm hay giảm ho…','Dùng theo hạn sử dụng trên sản phẩm. Sau khi mở nên bảo quản trong ngăn mát để dùng được lâu hơn, ngon hơn','./img_sp/sp69.jpg','Đồ khô'),(70,'Gừng Mật Ong','lọ',155000,'Hàn Quốc',5000,'1 lọ 1 kg','Gừng mật ong là sản phẩm truyền thống của Hàn Quốc, được chiết xuất từ gừng tươi và gừng cắt lát Hàn Quốc. Mật ong ngọt nguyên chất. Mỗi ngày pha uống với nước nóng hoặc thêm đá uống rất tốt cho sức khỏe.$Gừng mật ong bao gồm: Gừng thái lát, mật ong, Đường biotic fructose (đường thấp năng lượng tăng cường tiêu hóa), đường, acid citric...','Thơm, ngọt thơm mùi chanh','Gừng và mật ong là 2 vị thuốc tự nhiên có tác dụng cực kỳ hữu hiệu trong việc tăng sản xuất bạch cầu, giảm cơ chế gây hại cho cơ thể, cụ thể: ✅ Hỗ trợ điều trị hen suyễn ✅ Giảm khó chịu do viêm đường hô hấp ✅ Giảm buồn nôn và nôn mửa ✅ Ngăn ngừa Ung thư ✅ Tăng cường chức năng đường tiêu hoá ✅ Bảo vệ Tim mạch ✅ Giảm đau do kinh nguyệt ✅ Chống ung thư buồng trứng ✅ Tăng cường hệ miễn dịch ? Sản phẩm GỪNG MẬT ONG HÀn QUỐC được chế biến trong dây chuyền khép kín đảm bảo cân bằng về lượng đường - gừng - trà không hại cơ thể, vệ sinh an toàn thực phẩm. ? Có thể pha nước sôi để nguội, thêm đá uống ngay rất ngon. Hoặc ăn như một loại mứt với bánh mì buổi sáng.$Giúp cơ thể tiết mồ hôi.$Đào thải các chất độc hại trong cơ thể.$Phòng ngừa cảm cúm hay giảm ho…','Dùng theo hạn sử dụng trên sản phẩm. Sau khi mở nên bảo quản trong ngăn mát để dùng được lâu hơn, ngon hơn','./img_sp/sp70.jpg','Đồ khô'),(71,'Hạnh nhân mật ong','túi',99000,'Hàn Quốc',5000,'túi 200g','Túi 200g màu vàng có hình chú ong rất dễ thương. Hạt hạnh nhân được sấy khô tẩm ướp với mật ong tạo nên vị ngọt, bùi, dễ ăn hơn hạt hạnh nhân khô thông thường','Bùi, ngọt tự nhiên của mật ong','Các nghiên cứu khoa học đã chỉ ra rằng trong 1 chén hạt hạnh nhân có 45g chất béo trong đó 28 g là chất béo không bão hòa đơn, 11g chất béo không bão hòa đa và chỉ có 3,4 g chất béo bão hòa.$Hàm lượng protein cao, chất béo tốt và chất xơ phong phú chính là điều kiện lý tưởng để phát huy tác dụng của hạt hạnh nhân  trong việc hỗ trợ giảm cân rất tuyệt vời.$Trong hạt hạnh nhân chứa nhiều chất chống oxy hóa như flavonoid có trong các loại rau củ, trái cây, trà xanh.$Flavonoid là chất chống oxy hóa mạnh giúp loại bỏ các gốc tự do gây hại cho cơ thể và làm cho chúng ta già đi.$Ngoài ra, hạnh nhân có chứa dồi dào lượng Vitamin A, E, B và các khoáng chất Đồng, Magie, Mangan...','Luôn để hạt hạnh nhân ở những nơi khô ráo, mát mẻ, có độ ẩm thích hợp và tránh tiếp xúc trực tiếp với ánh nắng mặt trời. Cũng như hạnh nhân tươi, bảo quản hạnh nhân khô cũng dùng các lọ thuỷ tinh để đựng và đậy nắp vào rồi cho vào ngăn mát tủ lạnh.','./img_sp/sp71.jpg','Đồ khô'),(72,'Nho khô túi 277 gam','túi',79000,'Mỹ',5000,'1 túi 277g','Nho khô Sunview được sấy khô từ 3 loại nhỏ đỏ, nho đen, nho xanh. Không như những loại nho khác, nho khô Sunview được tuyển chọn từ những trái nho tươi, trái to, qua quy trình sấy khô, trộn, bỏ cuống, bù nước làm ẩm nho tránh khô cứng... để cho ra đời \"siêu phẩm Nho khô Sunview\". ','Vị ngọt vừa ăn, thơm mùi nho','- Nho khô Sunview Raisins chứa vitamin, khoáng chất, và là chất chống oxy hóa tuyệt vời, có thể ngăn ngừa ung thư, tốt cho tiêu hóa, tăng cường năng lượng và hệ thống miễn dịch, đồng thời làm đẹp da, tóc,...$- Nho khô đặc biệt tốt cho phụ nữ mang thai và trẻ em.','Để nơi khô ráo thoáng mát, tránh nhiệt độ cao và ánh sáng mặt trời','./img_sp/sp72.jpg','Đồ khô'),(73,'Hạnh nhân dâu tây','túi',99000,'Hàn Quốc',5000,'1 túi 180g','Gói 180g màu hồng rất dễ thương. Hạt hạnh nhân được sấy khô tẩm ướp với hương dâu tây tạo nên vị ngọt, bùi, dễ ăn hơn hạt hạnh nhân khô thông thường.','Vị bùi pha lẫn mùi thơm, ngọt','Các nghiên cứu khoa học đã chỉ ra rằng trong 1 chén hạt hạnh nhân có 45g chất béo trong đó 28 g là chất béo không bão hòa đơn, 11g chất béo không bão hòa đa và chỉ có 3,4 g chất béo bão hòa.$Hàm lượng protein cao, chất béo tốt và chất xơ phong phú chính là điều kiện lý tưởng để phát huy tác dụng của hạt hạnh nhân  trong việc hỗ trợ giảm cân rất tuyệt vời.$Trong hạt hạnh nhân chứa nhiều chất chống oxy hóa như flavonoid có trong các loại rau củ, trái cây, trà xanh.$Flavonoid là chất chống oxy hóa mạnh giúp loại bỏ các gốc tự do gây hại cho cơ thể và làm cho chúng ta già đi.$Ngoài ra, hạnh nhân có chứa dồi dào lượng Vitamin A, E, B và các khoáng chất Đồng, Magie, Mangan...','Luôn để hạt hạnh nhân ở những nơi khô ráo, mát mẻ, có độ ẩm thích hợp và tránh tiếp xúc trực tiếp với ánh nắng mặt trời. Cũng như hạnh nhân tươi, bảo quản hạnh nhân khô cũng dùng các lọ thuỷ tinh để đựng và đậy nắp vào rồi cho vào ngăn mát tủ lạnh.','./img_sp/sp73.jpg','Đồ khô');
